INSERT INTO `my_about` VALUES ('1', 'intro', '中国矿业大学（北京）信息公开指南', '<p style=\"font-family: Simsun; font-size: 16px;\">为了保障公民、法人和其他组织依法获取学校信息，根据《中华人民共和国政府信息公开条例》和《高等学校信息公开办法》等有关规定，结合《中国矿业大学（北京）信息公开实施办法（试行）》，制定本指南。需要获得学校信息公开服务的公民、法人和其他组织，建议阅读本指南。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　本指南将根据具体情况及时更新。</p><p style=\"font-family: Simsun; font-size: 16px;\"><strong>　　一、主动公开</strong></p><p style=\"font-family: Simsun; font-size: 16px;\">　　（一）公开范围</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校主动公开的信息范围参见学校编制的《中国矿业大学（北京）信息公开目录》（以下简称《目录》）。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（二）公开形式</p><p style=\"font-family: Simsun; font-size: 16px;\">　　对于主动公开的信息，学校主要通过“信息公开”网上专栏及学校各单位网站、广播、电视、报刊、相关会议以及其他便于公众、法人和其他组织知晓的形式进行公开。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（三）公开时限</p><p style=\"font-family: Simsun; font-size: 16px;\">　　各类应当公开的信息产生后，学校各单位将在信息制作完成或获取之日起 20 个工作日内公开；公开的信息内容发生变更的，将在变更后的 20 个工作日内更新。法律、法规对信息公开的期限另有规定的，从其规定。</p><p style=\"font-family: Simsun; font-size: 16px;\"><strong>　　二、依申请公开</strong></p><p style=\"font-family: Simsun; font-size: 16px;\">　　公民、法人和其他组织需要学校提供主动公开以外的学校信息，可以向学校申请获取。学校依申请提供信息时，根据掌握该信息的实际状态进行提供，不对信息进行加工、统计、研究、分析或者其他处理。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（一）受理机构</p><p style=\"font-family: Simsun; font-size: 16px;\">　　机构名称：中国矿业大学（北京）信息公开办公室</p><p style=\"font-family: Simsun; font-size: 16px;\">　　办公地址：中国矿业大学（北京）党政办公室</p><p style=\"font-family: Simsun; font-size: 16px;\">　　办公时间：学校工作日（周一至周五）上午 8:30 － 11 ： 00 下午 2:30 － 5:00</p><p style=\"font-family: Simsun; font-size: 16px;\">　　联系电话： 010-62331691</p><p style=\"font-family: Simsun; font-size: 16px;\">　　传真号码： 010-62325016</p><p style=\"font-family: Simsun; font-size: 16px;\">　　电子邮件： xxgk@cumtb.edu.cn</p><p style=\"font-family: Simsun; font-size: 16px;\">　　邮政编码： 100083</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（二）提出申请</p><p style=\"font-family: Simsun; font-size: 16px;\">　　申请人向学校提出申请，须全面、如实填写《中国矿业大学（北京）信息公开申请表》（以下简称《申请表》）。《申请表》可在学校网站信息公开专栏下载，也可到学校信息公开办公室领取。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　申请人提出申请的方式包括：</p><p style=\"font-family: Simsun; font-size: 16px;\">　　1 ．现场申请。申请人可以到信息公开办公室填写《申请表》，现场提出申请。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　2 ．通过互联网提出申请。申请人可以在学校信息公开网站上下载电子版《申请表》，填写完成后直接发送至电子邮箱：<a href=\"mailto:xxgk@cumtb.edu.cn\">xxgk@cumtb.edu.cn</a>。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　3 ．信函、传真申请。申请人可以通过信函、传真方式提出申请，请在信函、传真的适当位置标注“信息公开申请”的字样。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　申请获取学校信息的个人，应提供有效身份证件（身份证与工作证等），法人与其它组织应提供相应有效的机构、组织证明文件（如《企业法人营业执照》、《组织机构代码证》等）。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　一张《申请表》只能申请一件信息公开请求，申请人对所需信息的描述应尽量详尽、明确。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校不受理直接通过电话提出的信息公开申请，但申请人可以通过电话咨询申请程序。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（三）申请处理</p><p style=\"font-family: Simsun; font-size: 16px;\">　　1 ．审查</p><p style=\"font-family: Simsun; font-size: 16px;\">　　收到申请后，学校将从形式上对申请的要件是否完备进行审查，对于要件不完备的申请予以退回，要求申请人补正。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　2 ．登记</p><p style=\"font-family: Simsun; font-size: 16px;\">　　对于《申请表》填写完整，并且申请人按相关规定提供了有效身份证件或证明文件的申请，在收到申请后予以登记。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　3 ．答复</p><p style=\"font-family: Simsun; font-size: 16px;\">　　自登记之日起 15 个工作日内，学校根据下列情况分别作出处理：</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 1 ）申请内容不明确的，将告知申请人在适当期限内作出更改、补正。申请人逾期未补正的，视为放弃本次申请；</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 2 ）属于公开范围的，告知申请人获取该信息的方式和途径；</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 3 ）属于不予公开范围的，告知申请人并说明理由；</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 4 ）不属于学校公开或者该信息不存在的，告知申请人；</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 5 ）申请公开的信息中含有不应当公开的内容，但能够区分处理的，可予部分公开；</p><p style=\"font-family: Simsun; font-size: 16px;\">　　（ 6 ）同一申请人重复向学校申请公开同一信息，学校已经作出答复的，将不再重复处理。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　4. 处理时限</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校收到信息公开申请，能够当场答复或提供的，将当场予以答复或提供；不能当场答复或提供的，自登记之日起 15 个工作日内予以答复或提供；因故在规定期限内未做出答复的，可以将答复期限适当延长并告知申请人，延长答复的期限最长不超过 15 个工作日。申请公开的信息涉及第三方权益的，征求第三方意见所需时间不计算在规定期限内。因不可抗力或者其他法定事由不能在规定期限内作出答复的，期限中止，障碍消除后恢复计算。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　5. 收费</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校依申请提供信息，收取实际发生的合理的检索、复制、邮寄等费用，收费标准由学校财务处依照价格管理部门规定而确定。如申请人确因经济困难需申请减免费用的，可在《申请表》中说明。</p><p style=\"font-family: Simsun; font-size: 16px;\"><strong>　　三、监督方式及程序</strong></p><p style=\"font-family: Simsun; font-size: 16px;\">　　公民、法人和其他组织认为学校以及所属单位未切实履行信息公开义务的，可向学校纪委监察部门投诉。</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校监察处电话： 010-62331416</p><p style=\"font-family: Simsun; font-size: 16px;\">　　学校监察处地址：中国矿业大学（北京）监察处</p><p style=\"font-family: Simsun; font-size: 16px;\">　　邮政编码： 100083</p><p style=\"font-family: Simsun; font-size: 16px;\">　　附：<a href=\"http://xxgk.cumtb.edu.cn/downloads/xxgksqb.doc\" target=\"_blank\">中国矿业大学（北京）信息公开申请表</a></p><div><br /></div>', '0', '0', '1414209759'), ('2', 'contactus', '联系我们', '<h3>\r\n	联系方式\r\n</h3>\r\n<p>\r\n	美丽说（北京）网络科技有限公司<br />\r\n邮箱： kefu@meilishuo.com<br />\r\n联系电话：010-82486129<br />\r\n总部地址：北京市海淀区中关村大街19号新中关购物中心A座7层  邮编：100080<br />\r\n上海公司地址：上海市静安区北京西路1701号2601室（静安中华大厦） 邮编：200040\r\n</p>\r\n<h3>\r\n	市场合作\r\n</h3>\r\n<p>\r\n	电话：010-62672483-612（北京）  021-62108005（上海）\r\n</p>\r\n<h3>\r\n	广告投放与品牌推广\r\n</h3>\r\n<p>\r\n	郑重声明：美丽说没有任何所谓官方代理<br />\r\n咨询电话：4000-800-588<br />\r\n企业QQ：4000800588\r\n</p>\r\n<h3>\r\n	媒体联系\r\n</h3>\r\n<p>\r\n	电话：010-62672483-603（北京）<br />\r\nEmail：pr@meilishuo.com\r\n</p>', '0', '0', '0'), ('3', 'joinus', '加入我们', '在美丽说工作<br />\r\n有兴趣请将简历email投递至hr@meilishuo.com<br />\r\n<p>\r\n	并注明申请职位名称。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<h3>\r\n		商业产品经理\r\n	</h3>\r\n	<div>\r\n		<span>职位要求：</span> 1.本科以上学历，3年以上商业产品相关工作经验；<br />\r\n2.具有高度的数据敏感性和数据分析能力，逻辑思维能力强，商业触觉敏锐；<br />\r\n3.熟悉互联网广告市场，对互联网广告平台、广告网络、广告产品有深刻理解和认识；<br />\r\n4.熟悉淘宝、阿里、SNS、或女性垂直媒体行业商业产品者优先； <span>工作职责：</span> 1.负责美丽说商业产品规划、网站流量变现；<br />\r\n2.负责制定商业产品价格策略与衡量监测机制；<br />\r\n3.负责制定不同客户广告投放机制与广告系统设计；<br />\r\n4.了解市场需求，与销售部门、网站运营部门、用户产品部门、研发部门紧密合作，规划与优化商业产品发展；\r\n	</div>\r\n	<h3>\r\n		品牌广告客户经理\r\n	</h3>\r\n	<div>\r\n		<span>职位要求：</span> 1.抗压能力、沟通能力、提案能力较强；<br />\r\n2.两年以上互联网品牌广告相关销售经验；<br />\r\n3.有女性媒体广告销售经验者优先；<br />\r\n4.有女性电商广告销售经验者优先； <span>工作职责：</span> 1.负责美丽说品牌客户开发和市场拓展等工作；<br />\r\n2.根据销售目标，制定具体销售和工作部署计划，完成公司下达的销售任务；<br />\r\n3.根据客户需求，制定活动计划、推广计划，并进行执行；<br />\r\n4.与商业产品部门紧密合作，提出产品开发需求，并协助反馈与完善；\r\n	</div>\r\n</p>', '0', '0', '0'), ('4', 'privacy', '隐私保护政策', '<p>\r\n	我们非常重视您的隐私，保护用户隐私是美丽说的重点原则，在您使用美丽说提供的服务前，请您仔细阅读以下隐私保护原则。\r\n</p>\r\n<h3>\r\n	一、用户信息\r\n</h3>\r\n<p>\r\n	美丽说将对您所提供的资料进行严格的管理及保护，美丽说通过技术手段、提供隐私保护服务功能、强化内部管理等办法充分保护用户的个人资料安全。美丽说为用\r\n户提供对个人注册信息的绝对的控制权，用户可以通过“修改个人信息”查看或修改个人信息。用户自愿注册个人信息，用户在注册时提供的所有信息，都是基于自\r\n愿，用户有权在任何时候拒绝提供这些信息。美丽说保证不对外公开或向第三方提供用户注册的个人资料，及用户在使用服务时存储的非公开内容，但下列情况除\r\n外：<br />\r\n◇ 事先获得您的明确授权； <br />\r\n◇ 根据有关的法律法规要求；<br />\r\n◇ 按照相关司法机构或政府主管部门的要求；<br />\r\n◇ 只有透露你的个人资料，才能提供你所要求的产品和服务；<br />\r\n◇ 因黑客行为或用户的保管疏忽导致帐号、密码遭他人非法使用；<br />\r\n◇ 由于您将用户密码告知他人或与他人共享注册帐户，由此导致的任何个人资料泄露。\r\n</p>\r\n<h3>\r\n	二、Cookies和其他浏览器技术\r\n</h3>\r\n<p>\r\n	当用户访问美丽说的时候，我们可能会保存会员的用户登录状态并且为用户分配一个或多个“Cookies”（一个很小的文本文件），例如：当会员访问一个需\r\n要会员登录才可以提供的信息或服务，当会员登录时，我们会把该会员的登录名和密码加密存储在该会员计算机的Cookie文件中，由于是不可逆转的加密存\r\n储，其他人即使可以使用该会员的计算机，也无法识别出会员的用户名和密码。会员并不需要额外做任何工作，所有的收集和保存都由系统自动完成。\r\n</p>\r\n<p>\r\n	Cookie文件将永久的保存在您的计算机硬盘上，除非您使用浏览器或操作系统软件手工将其删除。您也可以选择“不使用Cookie”或“在使用Cookie时事先通知我”的选项禁止Cookie的产生，但是您将为此无法使用一些美丽说的查询和服务。\r\n</p>\r\n<h3>\r\n	三、合作伙伴\r\n</h3>\r\n<p>\r\n	我们选择有信誉的第三方公司或网站作为我们的合作伙伴为用户提供信息和服务。尽管我们只选择有信誉的公司或网站作为我们的合作伙伴，但是每个合作伙伴都会\r\n有与美丽说不同的隐私保护政策，一旦您通过点击进入了合作伙伴的网站，美丽说隐私保护原则将不再生效，我们建议您查看该合作伙伴网站的隐私条款，并了解该\r\n合作伙伴对于收集、使用、泄露您的个人信息的规定。\r\n</p>\r\n<p>\r\n	本隐私保护原则自2010年02月21日起生效。隐私保护原则的修改权、更新权均属美丽说。<br />\r\n如果您对此隐私保护原则有任何疑问或建议，请通过以下方式联系我们: kefu@meilishuo.com，我们会尽一切努力保护您的隐私。\r\n</p>', '0', '0', '0'), ('5', 'brands', '广告投放与品牌推广', '咨询电话：4000-800-588<br /