-- ----------------------------
--  Table structure for `my_action_log`
-- ----------------------------
DROP TABLE IF EXISTS `my_action_log`;
CREATE TABLE `my_action_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `type` int(11) NOT NULL COMMENT '操作的类型',
  `uid` int(11) NOT NULL COMMENT '操作员id',
  `username` varchar(50) NOT NULL COMMENT '操作员',
  `content` text NOT NULL COMMENT '操作内容',
  `oldvalue` text NOT NULL COMMENT '原来值',
  `newvalue` text NOT NULL COMMENT '新值',
  `modify_time` datetime NOT NULL COMMENT '操作时间',
  PRIMARY KEY (`id`),
  KEY `querylog` (`type`,`modify_time`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=277 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `my_action_log`
