-- ----------------------------
--  Table structure for `my_alarm_siteconf`
-- ----------------------------
DROP TABLE IF EXISTS `my_alarm_siteconf`;
CREATE TABLE `my_alarm_siteconf` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `category` tinyint(3) unsigned NOT NULL COMMENT '1 站 2组 3电池 4其他警情',
  `type` int(11) NOT NULL COMMENT '类型',
  `content` varchar(100) NOT NULL COMMENT '警情内容',
  `suggest` varchar(255) NOT NULL COMMENT '警情描述',
  `send_email` tinytext NOT NULL COMMENT '是否发邮件',
  `send_msg` tinyint(3) NOT NULL COMMENT '是否发邮件',
  `alarm_type` tinyint(3) NOT NULL COMMENT '1红色 2 橙色 3 黄色标准',
  `type_value` varchar(50) NOT NULL COMMENT '标准',
  `operator` varchar(10) NOT NULL COMMENT '运算符',
  `judge_type` tinyint(3) NOT NULL COMMENT '警情判断类型（1--百分比，0--绝对值）',
  `can_ignore` tinyint(3) NOT NULL COMMENT '1可忽略 2 不可忽略',
  `alarm` varchar(20) DEFAULT NULL COMMENT '对应的B0bUH编码',
  `alarm_code` varchar(30) NOT NULL COMMENT '警情代码',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `sn_key` bigint(14) NOT NULL COMMENT '站点的id',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '1 开，2是关',
  PRIMARY KEY (`id`),
  KEY `type` (`type`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=3710 DEFAULT CHARSET=utf8;

