-- ----------------------------
--  Table structure for `my_alarmset`
-- ----------------------------
DROP TABLE IF EXISTS `my_alarmset`;
CREATE TABLE `my_alarmset` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `aid` int(11) NOT NULL COMMENT '区域id',
  `area` varchar(50) NOT NULL COMMENT '区域名称',
  `username` varchar(30) NOT NULL COMMENT '人员名称',
  `phone` varchar(20) NOT NULL COMMENT '电话',
  `phone_status` tinyint(3) unsigned NOT NULL COMMENT '是否启用',
  `email` varchar(50) NOT NULL COMMENT '邮箱',
  `email_status` tinytext NOT NULL COMMENT '邮箱状态',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `my_alerts`
-- ----------------------------
DROP TABLE IF EXISTS `my_alerts`;
CREATE TABLE `my_alerts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(200) NOT NULL COMMENT '对应的报警代码',
  `limit` varchar(200) DEFAULT NULL,
  `current` varchar(200) DEFAULT NULL,
  `ignore` int(1) NOT NULL DEFAULT '0',
  `time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `markup` text COMMENT '处理方案描述',
  `markuptime` timestamp NULL DEFAULT NULL,
  `sn_key` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `status` int(1) DEFAULT '0' COMMENT '0为未处理   1为已处理 2为忽略',
  `contact` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8;

