-- ----------------------------
--  Table structure for `my_articles`
-- ----------------------------
DROP TABLE IF EXISTS `my_articles`;
CREATE TABLE `my_articles` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(10) unsigned NOT NULL DEFAULT '0',
  `type` tinyint(1) NOT NULL,
  `cid` int(10) unsigned NOT NULL DEFAULT '0',
  `scid` int(10) unsigned NOT NULL,
  `hits` int(10) unsigned NOT NULL DEFAULT '0',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0',
  `update_time` int(11) unsigned NOT NULL,
  `picid` int(10) unsigned NOT NULL DEFAULT '0',
  `picpath` varchar(45) NOT NULL DEFAULT '',
  `alias` varchar(255) NOT NULL DEFAULT '',
  `title` varchar(255) NOT NULL DEFAULT '',
  `content` mediumtext NOT NULL,
  `tag` varchar(50) NOT NULL,
  `seotitle` varchar(255) NOT NULL DEFAULT '',
  `metakeywords` varchar(255) NOT NULL DEFAULT '',
  `metadesc` varchar(255) NOT NULL DEFAULT '',
  `userid` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `channelid` (`pid`) USING BTREE,
  KEY `posttime` (`create_time`) USING BTREE,
  KEY `cate` (`cid`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `type_2` (`type`) USING BTREE,
  FULLTEXT KEY `content` (`content`)
) ENGINE=MyISAM AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;

