INSERT INTO `my_articles` VALUES ('35', '61', '0', '64', '0', '0', '1414119461', '1414133827', '0', '', '', '北京高校先进基层党组织优秀共产党员优秀党务工作者拟表彰人选公示公告(2014-5-30)', '<pre class=\"STYLE1\"><span class=\"STYLE1\"> 为做好北京高校先进基层党组织、优秀共产党员和优秀党务工作者的评选表彰工作，在各分党委（党总支）和学校党委推荐的基础上，市委教育工委5月中旬邀请党建专家，依据评审条件，研究提出了表彰建议名单。 6月3日市委教育工委委员会研究确定了北京高校先进基层党组织、优秀共产党员和优秀党务工作者拟表彰名单。为增加表彰工作透明度，扩大评优工作的民主，按照《中共北京市委教育工作委员会关于评选表彰北京高校先进基层党组织优秀共产党员优秀党务工作者的通知》（京教工〔2014〕18号）要求，决定对我校拟表彰名单进行公示，具体如下。 \r\n    一、公示对象 \r\n    1.北京高校先进基层党组织（1个）：</span> <span class=\"STYLE5\"> 中国矿业大学（北京）力学与建筑工程学院党委</span></pre>\r\n<pre class=\"STYLE1\"><span class=\"STYLE5\"> </span><span class=\"STYLE1\">2.北京高校优秀共产党员（2名）： </span> <span class=\"STYLE5\"><strong>何满潮    中国矿业大学（北京）深部岩土力学与地下工程</strong><strong>国家重点实验室主任、中科院院士、教授 </strong> <strong> 吴  淼    中国矿业大学（北京）机电与信息工程学院机械系教授</strong></span><strong> </strong></pre>\r\n<pre class=\"STYLE1\"><strong> </strong>二、公示期限 \r\n    2014年6月6日-6月13日。\r\n    三、意见收集方式 \r\n    在公示期内，学校任何单位和个人如对公示对象有异议，可通过来信、来电、来访、电子邮件等方式向校党委组织部和纪委反映问题和意见。联系电话：62331206、62339996（组织部），62331431（纪委办公室），电子邮件：<a href=\"mailto:zzb@cumtb.edu.cn\">zzb@cumtb.edu.cn</a>（纪委），<a href=\"mailto:jjsc@cumtb.edu.cn\">jjsc@cumtb.edu.cn</a>（纪委）。 &nbsp;</pre>\r\n<pre class=\"STYLE1\">                                                                                                                   中共中国矿业大学（北京）委员会\r\n                                                                                                                           2014年6月6日 </pre>', '党务工作', '', '党务工作', '', '1'), ('36', '61', '0', '62', '0', '0', '1414133962', '1414136653', '0', '', '', '关于2014年组织选拔博士生（后）、高校青年教师、辅导员到北京市挂职锻炼的通知(2014-6-11) ', '<p class=\"MsoNormal\">\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:黑体;\">&nbsp;</span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<strong><span style=\"font-size:18pt;font-family:宋体;\">&nbsp;</span></strong>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<strong><span style=\"font-size:18pt;font-family:宋体;\">&nbsp;</span></strong>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<strong><span style=\"font-size:18pt;font-family:黑体;font-weight:normal;\">关于<span>2014</span>年组织选拔博士生（后）、高校青年教师、辅导员到北京市挂职锻炼的通知<span></span></span></strong>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<strong><span style=\"font-size:16pt;font-family:仿宋;\">&nbsp;</span></strong>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">各高校党委：</span><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\"></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">为拓展北京高校博士生（后）、青年教师和辅导员的社会实践渠道，充分发挥首都教育资源和智力优势，发现、培养和储备一批有发展潜力的青年人才，为北京建设中国特色世界城市提供人才支持，根据《关于组织选拔博士生和博士后到北京市挂职锻炼的意见》（京组发〔<span>2007</span>〕<span>6</span>号）、</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">《关于组织北京高校青年教师开展社会实践的实施意见》（</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">京教工〔<span>2012</span>〕<span>34</span>号</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">）、</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">《关于加强北京高校辅导员队伍建设的实施意见》（京教工〔<span>2008</span>〕<span>101</span>号）和《北京高校辅导员队伍建设规划（<span>2013-2015</span>年）》（京教工〔<span>2012</span>〕<span>60</span>号）等文件精神，市委组织部、市委教育工委和市教委<span>2014</span>年继续开展组织选拔博士生（后）、青年教师、辅导员到北京市挂职锻炼工作。现通知如下：<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">一、工作任务<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">从首都高校和相关科研院所选拔<span>300</span>名左右政治素质好、工作作风实的优秀博士生（后）、高校青年教师、辅导员到北京市各级党政机关和国有企事业单位挂职锻炼。博士生（后）为<span>200</span>人左右，高校青年教师、辅导员为<span>100</span>人左右，在高校青年教师中，从事就业指导工作的教师<span>10</span>人左右。所挂职务一般为正处级部门或单位主要负责人助理，国有企事业单位挂任相应职务。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">各高校指定一个部门统筹协调挂职有关工作。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">二、选拔条件<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">政治素质好，学有所长，具有较高的专业知识水平和较深的理论功底，志愿到北京市各级党政机关或国有企事业单位挂职锻炼。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、博士生须为纳入国家统一招生计划的北京地区普通高校和科研院所在读人员（不含委培和定向），原则上不推荐博士一年级的学生参加挂职锻炼；博士后须为在北京高校、科研院所和北京地区博士后流动站、博士后科研工作站从事研究工作的人员。博士生（后）参与挂职锻炼，原则上在读期间只参加一次。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">3</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、高校青年教师应具备<span>2</span>年以上高校教学、科研工作经验，高校辅导员原则上要在岗工作<span>3</span>年以上，高校青年教师和辅导员挂职锻炼期间不再承担原单位工作。科研院所的青年教师和辅导员不参与挂职锻炼。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">4</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、博士生年龄一般不超过<span>35</span>周岁，博士后年龄一般不超过<span>40</span>周岁，高校青年教师年龄不超过<span>45</span>岁，高校辅导员年龄不超过<span>40</span>周岁。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">5</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、应具有挂职岗位所要求的素质和能力，遵守挂职工作纪律和挂职单位相关规章制度。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">6</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、身心健康。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">三、挂职时间<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职时间均为半年，<span>2014</span>年<span>7</span>月开始，<span>12</span>月底结束。挂职锻炼期间，博士生每周应保证在挂职单位工作<span>2-3</span>天，<span>2014</span>年<span>7-8</span>月期间需全职工作；博士后、高校青年教师、辅导员需全职工作。</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职单位有具体要求的以单位要求为准。</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\"></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">四、选拔程序<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">选拔工作从<span>2014</span>年<span>5</span>月启动，<span>7</span>月上旬挂职人员正式到岗工作。</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\"></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1.</span></b><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">统计需求。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">5</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">月底前，市委组织部协调各区县局级单位和市属国有企事业单位，根据工作需要提出挂职岗位需求。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.25pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2.</span></b><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">组织报名。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">6</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">月<span>10</span>日，市委教育工委在宣教之窗网站<span>http://xjc.bjedu.gov.cn/</span>发布通知，学校进行动员部署，<span>6</span>月<span>10</span>日至<span>6</span>月<span>19</span>日，报名人员登录“首都高校博士生（后）、青年教师和辅导员挂职锻炼管理系统” （<span><a href=\"http://211.153.18.50:8089/SGB\"><span style=\"color:windowtext;\">http://211.153.18.50:8089/SGB</span></a></span>）进行注册报名，学校对报名人员资格进行审核，并复审确定报名人选。原则上，一个挂职岗位本校只能有一名报名。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.25pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">3.</span></b><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">双向选择。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">6</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">月<span>27</span>日前，挂职单位对报名人员进行初审、面试，双方确定挂职意向后，挂职单位登录管理系统确认拟录用人员。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.25pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">4</span></b><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、岗位调剂。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">根据第一轮报名双选情况，确定是否开展调剂。调剂工作于<span>7</span>月<span>4</span>日前完成。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.25pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">5</span></b><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、确定挂职人员名单。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职单位拟录用人员名单经教工委、市委组织部确认后，最终确定挂职人员名单。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">6<b>.</b></span><b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">到岗锻炼。</span></b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">7</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">月上旬，组织挂职人员进行岗前培训；<span>7</span>月<span>10</span>日前，安排挂职人员正式上岗锻炼。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">五、政策保障<span></span></span></b>\r\n	</p>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">对于达到出勤要求的博士生（后），按照每人每月<span>700</span>元的标准发放交通生活补助；对于未达到出勤要求的挂职人员，按照每人每天<span>80</span>元的标准扣发交通生活补助。<b><span></span></b></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">博士生（后）交通生活补助统一从市委教育工委“首都高校研究生社会实践专项资金”中支付，博士后、青年教师、辅导员挂职期间的工资待遇由派出单位发放，工作量核算按照派出单位相关规定执行。北京市教育系统人才交流服务中心负责于每月<span>10</span>日前按照出勤情况将上月补助发放至博士生（后）指定的北京银行卡账户中。市委教育工委统一为挂职人员办理人身意外伤害保险，医疗和其他有关保险由高校承担。<span></span></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">3.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职单位根据调研课题进展及实际工作情况，需延长挂职时间的，经与挂职人员及派出单位协商一致后，于挂职结束前<span>15</span>日内向市教育系统人才交流服务中心提出延长挂职时间书面申请，经市委组织部批准后予以延长。延长挂职锻炼时间的博士生，不再发放交通生活补助。<span></span></span></pre>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">六、有关要求<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、各高校要高度重视组织选拔工作。广泛宣传，严格把关，切实推荐选拔政治素质好、工作作风实的博士生（后）、青年教师和辅导员参加挂职锻炼。<span></span></span>\r\n	</p>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、加强组织选拔工作的统筹协调。挂职锻炼工作涉及博士生、博士后、青年教师、辅导员四种身份的人员，涉及学校多个部门，协调工作多。各高校应指定一个部门统筹协调，保证宣传动员、报名初审、复审等各项工作的有序进行；要明确挂职工作联系人，负责挂职工作的沟通协调。挂职锻炼工作由北京市教育系统人才交流服务中心（以下简称“北京教育人才中心”）负责具体组织管理，各高校要积极配合北京教育人才中心做好各项具体工作。<span></span></span></pre>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">3</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、加强挂职人员的管理。挂职人员的日常管理以挂职单位为主，选派单位要加强与挂职单位的沟通联系，对挂职人员的工作表现和出勤情况进行跟踪管理，关注挂职人员的思想动态，关心挂职人员的工作情况。对于全职参加挂职的人员，要安排人员对其承担的工作进行交接，保证挂职人员全身投入挂职工作。<span></span></span>\r\n	</p>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">4.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\"> </span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职锻炼期间，博士生（后）每月<span>5</span>日前通过公共邮箱提交本人前月挂职锻炼工作总结与挂职心得，反映挂职工作情况、收获体会以及</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">与挂职工作相关的新闻事件。青年教师和辅导员要按进度填写《北京高校青年教师社会实践手册》。北京市教育系统人才交流服务中心负责对挂职人员提交工作总结与挂职心得的情况进行考核管理，优秀文章将定期在“首都博士生（后）、高校青年教师和辅导员挂职锻炼通讯”上选登。<span></span></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">5.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职锻炼结束前，博士生（后）要撰写挂职锻炼工作总结，并结合本人在挂职期间</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">所承担的工作任务，向所在挂职单位提交一份调研报告。<span></span></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">6.</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">挂职锻炼期满后，挂职单位根据挂职人员的综合表现，从“德、能、勤、绩”等方面对其进行考核，填写《挂职锻炼情况考核表》或《挂职锻炼总结鉴定表》，由区县局级单位或市属国有企事业单位的组织（人事）部门签署意见后，转交所在高校存入个人档案。<span></span></span></pre>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32.15pt;\">\r\n		<b><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">七、联系方式<span></span></span></b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">市委组织部干部调配处<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>安泽辉<span>&nbsp;&nbsp;63088238</span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">市委教育工委宣教处<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>王星星<span>&nbsp;&nbsp;63088420</span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">市教育系统人才交流服务中心<span>&nbsp;&nbsp;</span>王宏梅<span>&nbsp;&nbsp;68986837</span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">本通知可到宣教之窗网站下载。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">附件：<span>2014</span>年挂职网络报名审核双选工作流程<span></span></span>\r\n	</p>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">&nbsp;</span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">&nbsp;</span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">中共北京市委组织部<span></span></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">中共北京市委教育工作委员会<span></span></span></pre>\r\n<pre><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">北京市教育委员会<span></span></span></pre>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:152.95pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2014</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">年<span>6</span>月<span>9</span>日<span></span></span>\r\n	</p>\r\n<span style=\"line-height:normal;font-size:16pt;font-family:仿宋_GB2312;\"><br />\r\n</span><span style=\"font-family:Simsun;font-size:medium;line-height:normal;\"></span>\r\n	<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">附件：<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<span style=\"font-size:16pt;font-family:黑体;\">2014</span><span style=\"font-size:16pt;font-family:黑体;\">年博士生（后）、高校青年教师和辅导员挂职<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<span style=\"font-size:16pt;font-family:黑体;\">网络报名审核双选工作流程<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">&nbsp;</span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2014</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">年博士生（后）、高校青年教师和辅导员挂职锻炼采取网上报名、网上双选的方式，各高校、科研单位和各挂职单位应指定一个部门负责挂职管理相关工作。有挂职意向的人员可登录北京市教育系统人才交流服务中心（以下称“教育人才中心”）“首都高校博士生（后）、高校青年教师和辅导员挂职管理系统”（以下称“挂职系统”）<span>http://211.153.18.50:8089/SGB/</span>报名。具体流程如下：<span>&nbsp;&nbsp;&nbsp;</span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">一、注册、报名（报名截止日期<span>6</span>月<span>18</span>日<span>12:00</span>）<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">符合挂职锻炼条件的人员自愿登录挂职系统注册、报名，申报挂职岗位。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">二、高校和科研单位审核，确定报名人员名单（学校复审截止日期<span>6</span>月<span>19</span>日<span>17:00</span>）<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">高校和科研单位对报名人员进行审核，审核目的一是审查报名人员有无报名资格，二是对报名重岗现象进行校内调剂。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、对博士生和博士后的审核工作<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">高校和科研单位对符合挂职条件的博士生和博士后进行初审，通过初审的报名人员打印由系统生成的《<span>2014</span>年首都高校博士生（后）挂职锻炼推荐表》，经导师及相关部门签字盖章后，将推荐表交至各高校负责部门，高校负责部门在挂职管理系统中复审通过，确定报名人选。各高校负责部门从挂职管理系统中打印《<span>2014</span>年首都高校博士生（后）挂职锻炼汇总表》，加盖学校公章之后月<span>6</span>月<span>25</span>日前送至市教育人才中心。《<span>2014</span>年首都高校博士生（后）挂职锻炼推荐表》由各高校存档。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、对高校青年教师和辅导员的审核工作<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">高校青年教师和辅导员的审核流程为：高校青年教师和辅导员注册、报名——打印推荐表——相关部门签字盖章——高校负责部门审核通过，高校于<span>6</span>月<span>25</span>日前将《<span>2014</span>年首都高校青年教师挂职锻炼报名汇总表》《<span>2014</span>年首都高校辅导员挂职锻炼报名汇总表》送交市教育人才中心。《<span>2014</span>年首都高校青年教师、辅导员挂职锻炼推荐表》由各高校存档。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">三、挂职单位初审、面试，确定拟录用人员名单（<span>6</span>月<span>23</span>日<span>-6</span>月<span>27</span>日）<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、各挂职单位在挂职管理系统上对高校复审通过的报名人员进行初审，初审通过的人员进入双选阶段。初审未通过的人员等待调剂时重新审请岗位。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、挂职单位对初审通过的人员安排面试，面试结束后，在挂职管理系统上对拟录用人员进行复审操作。复审未通过的人员等待调剂时重新审请岗位。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">四、市教育人才中心审核，教工委和组织部审定挂职人员名单（<span>7</span>月<span>4</span>日前）<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">1</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、市教育人才中心对挂职单位拟录用人员进行审核，并报市委教育工委、市委组织部审定，最终确定挂职人员名单。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">2</span><span style=\"font-size:16pt;font-family:仿宋_GB2312;\">、挂职报名、双选工作结束，所有报名人员、高校和挂职单位登录挂职锻炼系统查询最终结果。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">五、岗前培训、上岗（<span>7</span>月上旬）<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">市委教育工委、市委组织部召开挂职锻炼动员大会，对挂职人员进行岗前培训，挂职单位和挂职人员在动员会上进行对接。挂职人员上岗工作。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">六、关于调剂工作的说明<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:32pt;\">\r\n		<span style=\"font-size:16pt;font-family:仿宋_GB2312;\">按照<span>2014</span>年挂职锻炼工作计划，本年度挂职人数控制在<span>300</span>人左右，如第一轮报名、双选结果达成既定目标，则不再安排调剂；如第一轮报名、双选结果未达到既定目标，则安排一次调剂，调剂工作于<span>7</span>月<span>4</span>日之前完成。调剂工作流程重复申请岗位之后的所有流程。<span></span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-align:justify;font-size:10.5pt;font-family:\'Times New Roman\';text-indent:21pt;\">\r\n		<span style=\"font-family:仿宋_GB2312;\">&nbsp;</span>\r\n	</p>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	<br />\r\n</p>', '挂职锻炼', '', '挂职锻炼', '', '1'), ('37', '61', '0', '64', '0', '0', '1414134514', '1414136736', '0', '', '', '陈平泽任前公示公告(2014-6-16)', '<div class=\"Section1\">\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		关于<span>2013</span>、<span>2014</span>年度“长江学者奖励计划”特聘教授\r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		2014年国家百千万人才工程\r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		2014年青年拔尖人才支持计划\r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		候选人推荐结果的公示\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:18pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		根据教育部《关于做好<span>2013</span>、<span>2014</span>年度“长江学者奖励计划”人选推荐工作的通知》精神和《中国矿业大学（北京）关于做好<span>2013</span>、<span>2014</span>年度“长江学者奖励计划”人选推荐工作的通知》要求，经个人申请、单位推荐、校专家评议组评议，拟推荐聂百胜、孙晓明教授为 2013、<span>2014</span>年度“长江学者奖励计划”特聘教授候选人，现予以公示。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		根据教育部《关于开展<span>2014</span>年国家百千万人才工程人选推荐工作的通知》精神和《中国矿业大学（北京）关于开展<span>2014</span>年国家百千万人才工程人选推荐工作的通知》要求，经个人申请、单位推荐、校专家评议组评议，拟推荐周宏伟教授为 <span>2014</span>年国家百千万人才工程人选候选人，现予以公示。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		根据教育部《关于做好<span>2014</span>年青年拔尖人才支持计划申报推荐工作的补充通知》和《中共中央组织部办公厅等关于做好<span>2014</span>年青年拔尖人才支持计划申报推荐工作的通知》精神以及《中国矿业大学（北京）关于关于做好<span>2014</span>年青年拔尖人才支持计划申报推荐工作的通知》要求，经个人申请、单位推荐、校专家评议组评议，拟推荐左建平、竹涛、刘洪涛、杨志宾、胡南薇五位同志<a name=\"_GoBack\"></a>为 <span>2014</span>年青年拔尖人才支持计划候选人，现予以公示。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28pt;\">\r\n		公示时间为<span>2014</span>年<span>6</span>月<span>19</span>日—25日。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		公示期间若有异议，请与人事处联系，联系电话：<span>62331878</span>、<span>62339138</span>。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:203pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:273pt;\">\r\n		&nbsp;人 事 处\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014<span><span>年6</span></span><span><span>月19</span></span><span><span>日</span></span> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<span>&nbsp;</span> \r\n	</p>\r\n</div>', '陈平泽任前公示公告', '', '陈平泽任前公示公告', '', '1'), ('38', '61', '0', '62', '0', '0', '1414134865', '1414134865', '0', '', '', '关于2013、2014年度“长江学者奖励计划”特聘教授 2014年国家百千万人才工程 2014年青年拔尖人才支持计划候选人推荐结果的公示(2014-6-19)', '<div class=\"Section1\">\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		关于<span>2013</span>、<span>2014</span>年度“长江学者奖励计划”特聘教授\r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\