&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014<span><span>年6</span></span><span><span>月19</span></span><span><span>日</span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<span>&nbsp;</span>\r\n	</p>\r\n</div>', '长春学者奖励计划', '', '长春学者奖励计划', '', '1'), ('39', '61', '1', '64', '0', '0', '1414135177', '1431589148', '0', '', '', '学校先进基层党组织优秀共产党员优秀党务工作者拟表彰人选公示公告(2014-6-24)', '<div class=\"Section1\">\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<b>公示公告</b> \r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<b>&nbsp;</b> \r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		为庆祝中国共产党建党九十三周年，认真总结学校基层党组织和党员队伍建设的先进经验，充分展示我校基层党组织、共产党员和党务工作者的良好形象，激励各基层党组织和广大党员更好地发挥政治核心作用、战斗堡垒作用和先锋模范作用，不断提高学校党建工作科学化水平，促进学校科学发展，学校决定表彰一批先进基层党组织、优秀党务工作者和优秀共产党员。按照《中共中国矿业大学（北京）委员会关于评选表彰先进基层党组织优秀共产党员优秀党务工作者的通知》（中矿京党字[2014]10号）文件要求，在基层党组织评选、推荐，党委组织部会同有关部门审查和初评的基础上，经<span>6</span>月<span>23</span>日学校党委常委会议审议通过，拟授予力学与建筑工程学院党委和资源与安全工程学院办公室党支部等<span>19</span>个党支部为“中国矿业大学（北京）先进基层党组织”荣誉称号，拟授予何满潮、吴淼等<span>104</span>位同志为“中国矿业大学（北京）优秀共产党员”荣誉称号，拟授予左东方等<span>25</span>名同志为“中国矿业大学（北京）优秀党务工作者”荣誉称号（具体名单见附件）。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		为增加表彰工作透明度，扩大评优工作的民主和群众参与程度，现将拟表彰的党组织和个人予以公示，公示时间为<span>6</span>月<span>24</span>日至<span>6</span>月<span>30</span>日。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		在公示期内，任何单位和个人如对公示对象有异议，可通过来信、来电、来访、电子邮件等方式向校党委组织部和纪委反映。联系电话：<span>62331206</span>、<span>62339996</span>（组织部），<span>62331431</span>（纪委办公室），电子邮件：<a href=\"mailto:zzb@cumtb.edu.cn\">zzb@cumtb.edu.cn</a>（组织部），jjsc@cumtb.edu.cn（纪委办公室）。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		特此公告\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:30pt;\">\r\n		附件：拟表彰的先进基层党组织优秀共产党员和优秀党务工作者名单\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.8pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:195.75pt;\">\r\n		中共中国矿业大学（北京）委员会\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:225pt;\">\r\n		二○一四年六月二十三日\r\n	</p>\r\n<br />\r\n	<p class=\"MsoNormal\">\r\n		附件：\r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<b>拟表彰的先进基层党组织优秀共产党员和</b> \r\n	</p>\r\n	<p align=\"center\" class=\"MsoNormal\" style=\"text-align:center;\">\r\n		<b>优秀党务工作者名单</b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<b>一、先进基层党组织（<span>20</span>个）</b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		1.力学与建筑工程学院党委<b>（同时被评为“北京高校先进基层党组织”）</b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		2.资源与安全工程学院办公室党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		3.资源学院硕<span>13-1</span>班党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		4.地球科学与测绘工程学院办公室党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		5.地球科学与测绘工程学院博<span>13</span>党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		6.化学与环境工程学院矿物加工工程系教工党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		7.化学与环境工程学院化学工程系党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		8.机电与信息工程学院本科<span>2010</span>级电气党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		9.机电与信息工程学院院办党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		10.管理学院研究生第五党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		11.管理学院研究生第七党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		12.力学与建筑工程学院建筑系党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		13.力学与建筑工程学院本二党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		14.理学院办公室党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		15.文法学院行管法学本科党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		16.思想政治教育学院思政硕士党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		17.机关党委学生工作处党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		18.机关党委党政办党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		19.后勤及产业党总支餐饮服务中心党支部\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		20.离退休党委退休化环与文法学院联合党支部\r\n	</p>\r\n	<p clas