ign=\"left\" class=\"MsoNormal\">\r\n		<b>何满潮（同时被评为“北京高校优秀共产党员”）</b> \r\n	</p>\r\n	<p align=\"left\" class=\"MsoNormal\">\r\n		赵<span>&nbsp; </span>诚<span>&nbsp; </span>董会泽<span>&nbsp; </span>胡丹萍<span>&nbsp; </span>桑婷婷\r\n	</p>\r\n	<p align=\"left\" class=\"MsoNormal\">\r\n		<b>后勤及产业党总支</b> \r\n	</p>\r\n	<p align=\"left\" class=\"MsoNormal\">\r\n		张<span>&nbsp; </span>颖<span>&nbsp; </span>牛增华\r\n	</p>\r\n	<p align=\"left\" class=\"MsoNormal\">\r\n		<b>离退休党委</b> \r\n	</p>\r\n	<p align=\"left\" class=\"MsoNormal\">\r\n		李明恒<span>&nbsp; </span>王静江<span>&nbsp; </span>高毓麟<span>&nbsp; </span> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<b>&nbsp;</b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<b>三、优秀党务工作者（<span>25</span>人）</b> \r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		资源与安全工程学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>左东方<span>&nbsp; </span>张肖丽\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		地球科学与测绘工程学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp; </span>张<span>&nbsp; </span>蕊<span>&nbsp; </span>张庆斌\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		化学与环境工程学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>孙铭晗<span>&nbsp; </span>严<span>&nbsp; </span>鼎\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		机电与信息工程学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>钱<span>&nbsp; </span>旭<span>&nbsp; </span>董瑞琦\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		管理学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>赵<span>&nbsp; </span>麟<span>&nbsp; </span>强<span>&nbsp; </span>堃\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		力学与建筑工程学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>马靖华<span>&nbsp; </span>张<span>&nbsp; </span>飚\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		理学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>谭<span>&nbsp; </span>凯<span>&nbsp; </span>宋彦琦<span>&nbsp; </span>章<span>&nbsp; </span>敏\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		文法学院党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>高来举<span>&nbsp; </span>李安心\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		思想政治教育学院党总支<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>樊<span>&nbsp; </span>凯<span>&nbsp; </span>江冰雪\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		机关党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>刘海娟<span>&nbsp; </span>姜骑山\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		后勤及产业党总支<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>杨庆舟<span>&nbsp; </span>杨向东\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		离退休党委<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>张信川<span>&nbsp; </span>项书敏\r\n	</p>\r\n</div>', '优秀共产党员', '', '优秀共产党员', '', '1'), ('40', '61', '0', '65', '0', '0', '1414135337', '1414136292', '0', '', '', '室内体育馆改造工程中央空调采购及安装招标公告(2014-7-1)', '<div id=\"main-title\">\r\n	<a href=\"http://jjc.cumtb.edu.cn/html2/zhaobiao10.html\" target=\"_blank\">http://jjc.cumtb.edu.cn/html2/zhaobiao10.html</a><br />\r\n</div>', '招标', '', '招标', '', '1'), ('41', '61', '0', '62', '0', '0', '1414135454', '1414135454', '0', '', '', '关于申报2015年度外国文教专家聘请计划的通知(2014-7-11) ', '<table width=\"98%\" align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<span><strong>关于申报2015年度外国文教专家聘请计划的通知 </strong></span> \r\n				<hr />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<table width=\"100%\" align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" class=\"ke-zeroborder\">\r\n					<tbody>\r\n						<tr>\r\n							<td width=\"100%\" align=\"middle\">\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td class=\"newstitle\" id=\"fontzoom\" valign=\"top\">\r\n								<!-- 文章内容 start -->\r\n								<div>\r\n									<div class=\"STYLE16\">\r\n										<p>\r\n											根据国家外国专家局和教育部相关文件精神，我校2015年度聘请外国文教专家项目申报工作即将开始。此次我校申报的外国文教专家聘请计划分为五类： <br />\r\n1、聘请对象为某一学科或者专业领域具有国际公认的较高学术造诣的外籍专家或者学者，<strong>每年来华累计时间不少于</strong><strong>60</strong><strong>天</strong>，可以申报<strong>“海外名师项目”</strong>。 <br />\r\n2、通过具有鲜明特征或者独特运作方式实施的聘请<strong>外国文教专家和外籍教师团队（不少于三名知名专家）</strong>从事教学、科研、社会服务和管理等工作的项目，尤其是聚焦某一方面或者某一领域实现不断改进和持续进步的，可以申报<strong>“学校特色项目”</strong>。 <br />\r\n3、根据学科发展和人才培养的实际需要，各单位负责人或者学科带头人可以联合校内（支持跨部门）相关领域教师共同聘请<strong>四人以上的专家团队</strong>申报<strong>“引智平台项目”</strong>，用于促进相关学科的科研发展、人才培养和科研团队建设。 <br />\r\n4、其他涉及国家级、省部级重点项目，高层次人才培养项目，高新技术开发、产学研结合项目，高校重点学科、新兴学科、交叉学科和重点实验室建设等项目，需要聘请外国文教专家的，可以申报<strong>“学校重点外专引智项目”</strong>。 <br />\r\n5、聘请对象为国外院校或科研机构普通学者或研究人员的，可以申报<strong>“聘请外国文教专家普通常规项目”</strong>。 <br />\r\n6、上述五类项目对比情况参见下文所附《各类引智项目对比表》。\r\n										</p>\r\n										<p>\r\n											请有意于2015年度聘请外专的老师于8月30日前联系所在学院主管外事负责人或我处索取相关材料，所有申报材料必须纳入所在学院的《2015年度外专聘请计划汇总表》。 <br />\r\n2015年度外专经费的支出将严格参照申报计划执行。没有申报计划的聘请外专引智任务，我处将不再予以经费支持。\r\n										</p>\r\n										<p>\r\n											联系人：杨英、王红梅 <br />\r\n办公地点：1号办公楼107室、105室<br />\r\n电话：62331301/62339599<br />\r\n电子邮箱：<a href=\"mailto:yangying@cumtb.edu.cn\">yangying@cumtb.edu.cn</a>\r\n										</p>\r\n<a class=\"STYLE15\" href=\"http://international.cumtb.edu.cn/gywm/20140709geleiyinzhixiangmuduibibiao.doc\" target=\"_blank\"><span>附件：各类引智项目对比表</span></a><br />\r\n										<p>\r\n											&nbsp;\r\n										</p>\r\n										<p align=\"right\">\r\n											<span class=\"STYLE15\">中国矿业大学（北京）<br />\r\n国际合作与交流处<br />\r\n二〇一四年七月二日</span>\r\n										</p>\r\n									</div>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '外国文教专家聘请', '', '外国文教专家聘请', '', '1'), ('42', '61', '0', '62', '0', '0', '1414135642', '1414135642', '0', '', '', '高等教育国家级教学成果奖申报(2014-7-21) ', '<a href=\"http://zyxy.cumtb.edu.cn/gjjjxcgjsb/home.html\" target=\"_blank\">http://zyxy.cumtb.edu.cn/gjjjxcgjsb/home.html</a>', '国家级教学成果奖申报', '', '国家级教学成果奖申报', '', '1'), ('58', '61', '0', '63', '0', '0', '1414489058', '1414489058', '0', '', '', '高等学校信息公开办法', '<table width=\"980\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\" style=\"font-family:宋体;\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"font-size:16px;\">\r\n				<p align=\"center\">\r\n					<strong>高等学校信息公开办法</strong>\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第一章　总则</strong>\r\n				</p>\r\n				<p>\r\n					第一条　为了保障公民、法人和其他组织依法获取高等学校信息，促进高等学校依法治校，根据高等教育法和政府信息公开条例的有关规定，制定本办法。\r\n				</p>\r\n				<p>\r\n					第二条　高等学校在开展办学活动和提供社会公共服务过程中产生、制作、获取的以一定形式记录、保存的信息，应当按照有关法律法规和本办法的规定公开。\r\n				</p>\r\n				<p>\r\n					第三条　国务院教育行政部门负责指导、监督全国高等学校信息公开工作。\r\n				</p>\r\n				<p>\r\n					省级教育行政部门负责统筹推进、协调、监督本行政区域内高等学校信息公开工作。\r\n				</p>\r\n				<p>\r\n					第四条　高等学校应当遵循公正、公平、便民的原则，建立信息公开工作机制和各项工作制度。\r\n				</p>\r\n				<p>\r\n					高等学校公开信息，不得危及国家安全、公共安全、经济安全、社会稳定和学校安全稳定。\r\n				</p>\r\n				<p>\r\n					第五条　高等学校应当建立健全信息发布保密审查机制，明确审查的程序和责任。高等学校公开信息前，应当依照法律法规和国家其他有关规定对拟公开的信息进行保密审查。\r\n				</p>\r\n				<p>\r\n					有关信息依照国家有关规定或者根据实际情况需要审批的，高等学校应当按照规定程序履行审批手续，未经批准不得公开。\r\n				</p>\r\n				<p>\r\n					第六条　高等学校发现不利于校园和社会稳定的虚假信息或者不完整信息的，应当在其职责范围内及时发布准确信息予以澄清。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第二章　公开的内容</strong>\r\n				</p>\r\n				<p>\r\n					第七条　高等学校应当主动公开以下信息：\r\n				</p>\r\n				<p>\r\n					（一）学校名称、办学地点、办学性质、办学宗旨、办学层次、办学规模，内部管理体制、机构设置、学校领导等基本情况；\r\n				</p>\r\n				<p>\r\n					（二）学校章程以及学校制定的各项规章制度；\r\n				</p>\r\n				<p>\r\n					（三）学校发展规划和年度工作计划；\r\n				</p>\r\n				<p>\r\n					（四）各层次、类型学历教育招生、考试与录取规定，学籍管理、学位评定办法，学生申诉途径与处理程序；毕业生就业指导与服务情况等 ;\r\n				</p>\r\n				<p>\r\n					（五）学科与专业设置，重点学科建设情况，课程与教学计划，实验室、仪器设备配置与图书藏量，教学与科研成果评选，国家组织的教学评估结果等；\r\n				</p>\r\n				<p>\r\n					（六）学生奖学金、助学金、学费减免、助学贷款与勤工俭学的申请与管理规定等；\r\n				</p>\r\n				<p>\r\n					（七）教师和其他专业技术人员数量、专业技术职务等级，岗位设置管理与聘用办法，教师争议解决办法等 ;\r\n				</p>\r\n				<p>\r\n					（八）收费的项目、依据、标准与投诉方式；\r\n				</p>\r\n				<p>\r\n					（九）财务、资产与财务管理制度，学校经费来源、年度经费预算决算方案，财政性资金、受捐赠财产的使用与管理情况，仪器设备、图书、药品等物资设备采购和重大基建工程的招投标；\r\n				</p>\r\n				<p>\r\n					（十）自然灾害等突发事件的应急处理预案、处置情况，涉及学校的重大事件的调查和处理情况；\r\n				</p>\r\n				<p>\r\n					（十一）对外交流与中外合作办学情况，外籍教师与留学生的管理制度；\r\n				</p>\r\n				<p>\r\n					（十二）法律、法规和规章规定需要公开的其他事项。\r\n				</p>\r\n				<p>\r\n					第八条　除第七条规定需要公开的信息外，高等学校应当明确其他需要主动公开的信息内容与公开范围。\r\n				</p>\r\n				<p>\r\n					第九条　除高等学校已公开的信息外，公民、法人和其他组织还可以根据自身学习、科研、工作等特殊需要，以书面形式（包括数据电文形式）向学校申请获取相关信息。\r\n				</p>\r\n				<p>\r\n					第十条　高等学校对下列信息不予公开：\r\n				</p>\r\n				<p>\r\n					（一）涉及国家秘密的；\r\n				</p>\r\n				<p>\r\n					（二）涉及商业秘密的；\r\n				</p>\r\n				<p>\r\n					（三）涉及个人隐私的；\r\n				</p>\r\n				<p>\r\n					（四）法律、法规和规章以及学校规定的不予公开的其他信息。\r\n				</p>\r\n				<p>\r\n					其中第（二）项、第（三）项所列的信息，经权利人同意公开或者高校认为不公开可能对公共利益造成重大影响的，可以予以公开。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第三章　公开的途径和要求</strong>\r\n				</p>\r\n				<p>\r\n					第十一条　高等学校校长领导学校的信息公开工作。校长（学校）办公室为信息公开工作机构，负责学校信息公开的日常工作，具体职责是：\r\n				</p>\r\n				<p>\r\n					（一）具体承办本校信息公开事宜；\r\n				</p>\r\n				<p>\r\n					（二）管理、协调、维护和更新本校公开的信息；\r\n				</p>\r\n				<p>\r\n					（三）统一受理、协调处理、统一答复向本校提出的信息公开申请；\r\n				</p>\r\n				<p>\r\n					（四）组织编制本校的信息公开指南、信息公开目录和信息公开工作年度报告；\r\n				</p>\r\n				<p>\r\n					（五）协调对拟公开的学校信息进行保密审查；\r\n				</p>\r\n				<p>\r\n					（六）组织学校信息公开工作的内部评议；\r\n				</p>\r\n				<p>\r\n					（七）推进、监督学校内设组织机构的信息公开；\r\n				</p>\r\n				<p>\r\n					（八）承担与本校信息公开有关的其他职责。\r\n				</p>\r\n				<p>\r\n					高等学校应当向社会公开信息公开工作机构的名称、负责人、办公地址、办公时间、联系电话、传真号码、电子邮箱等。\r\n				</p>\r\n				<p>\r\n					第十二条　对依照本办法规定需要公开的信息，高等学校应当根据实际情况，通过学校网站、校报校刊、校内广播等校内媒体和报刊、杂志、广播、电视等校外媒体以及新闻发布会、年鉴、会议纪要或者简报等方式予以公开；并根据需要设置公共查阅室、资料索取点、信息公告栏或者电子屏幕等场所、设施。\r\n				</p>\r\n				<p>\r\n					第十三条　高等学校应当在学校网站开设信息公开意见箱，设置信息公开专栏、建立有效链接，及时更新信息，并通过信息公开意见箱听取对学校信息公开工作的意见和建议。\r\n				</p>\r\n				<p>\r\n					第十四条　高等学校应当编制信息公开指南和目录，并及时公布和更新。信息公开指南应当明确信息公开工作机构，信息的分类、编排体系和获取方式，依申请公开的处理和答复流程等。信息公开目录应当包括信息的索引、名称、生成日期、责任部门等内容。\r\n				</p>\r\n				<p>\r\n					第十五条　高等学校应当将学校基本的规章制度汇编成册，置于学校有关内部组织机构的办公地点、档案馆、图书馆等场所，提供免费查阅。\r\n				</p>\r\n				<p>\r\n					高等学校应当将学生管理制度、教师管理制度分别汇编成册，在新生和新聘教师报到时发放。\r\n				</p>\r\n				<p>\r\n					第十六条　高等学校完成信息制作或者获取信息后，应当及时明确该信息是否公开。确定公开的，应当明确公开的受众；确定不予公开的，应当说明理由；难以确定是否公开的，应当及时报请高等学校所在地省级教育行政部门或者上级主管部门审定。\r\n				</p>\r\n				<p>\r\n					第十七条　属于主动公开的信息，高等学校应当自该信息制作完成或者获取之日起 20 个工作日内予以公开。公开的信息内容发生变更的，应当在变更后 20 个工作日内予以更新。\r\n				</p>\r\n				<p>\r\n					学校决策事项需要征求教师、学生和学校其他工作人员意见的，公开征求意见的期限不得少于 10 个工作日。\r\n				</p>\r\n				<p>\r\n					法律法规对信息内容公开的期限另有规定的，从其规定。\r\n				</p>\r\n				<p>\r\n					第十八条　对申请人的信息公开申请，高等学校根据下列情况在 15 个工作日内分别作出答复：\r\n				</p>\r\n				<p>\r\n					（一）属于公开范围的，应当告知申请人获取该信息的方式和途径；\r\n				</p>\r\n				<p>\r\n					（二）属于不予公开范围的，应当告知申请人并说明理由；\r\n				</p>\r\n				<p>\r\n					（三）不属于本校职责范围的或者该信息不存在的，应当告\r\n				</p>\r\n				<p>\r\n					知申请人，对能够确定该信息的职责单位的，应当告知申请人该单位的名称、联系方式；\r\n				</p>\r\n				<p>\r\n					（四）申请公开的信息含有不应当公开的内容但能够区分处理的，应当告知申请人并提供可以公开的信息内容，对不予公开的部分，应当说明理由；\r\n				</p>\r\n				<p>\r\n					（五）申请内容不明确的，应当告知申请人作出更改、补充；申请人逾期未补正的，视为放弃本次申请；\r\n				</p>\r\n				<p>\r\n					（六）同一申请人无正当理由重复向同一高等学校申请公开同一信息，高等学校已经作出答复且该信息未发生变化的，应当告知申请人，不再重复处理；\r\n				</p>\r\n				<p>\r\n					（七）高等学校根据实际情况作出的其他答复。\r\n				</p>\r\n				<p>\r\n					第十九条　申请人向高等学校申请公开信息的，应当出示有效身份证件或者证明文件。\r\n				</p>\r\n				<p>\r\n					申请人有证据证明高等学校提供的与自身相关的信息记录不准确的，有权要求该高等学校予以更正；该高等学校无权更正的，应当转送有权更正的单位处理，并告知申请人。\r\n				</p>\r\n				<p>\r\n					第二十条　高等学校向申请人提供信息，可以按照学校所在地省级价格部门和财政部门规定的收费标准收取检索、复制、邮寄等费用。收取的费用应当纳入学校财务管理。\r\n				</p>\r\n				<p>\r\n					高等学校不得通过其他组织、个人以有偿方式提供信息。\r\n				</p>\r\n				<p>\r\n					第二十一条　高等学校应当健全内部组织机构的信息公开制度，明确其信息公开的具体内容。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第四章　监督和保障</strong>\r\n				</p>\r\n				<p>\r\n					第二十二条　国务院教育行政部门开展对全国高等学校推进信息公开工作的监督检查。\r\n				</p>\r\n				<p>\r\n					省级教育行政部门应当加强对本行政区域内高等学校信息公开工作的日常监督检查。\r\n				</p>\r\n				<p>\r\n					高等学校主管部门应当将信息公开工作开展情况纳入高等学校领导干部考核内容。\r\n				</p>\r\n				<p>\r\n					第二十三条　省级教育行政部门和高等学校应当将信息公开工作纳入干部岗位责任考核内容。考核工作可与年终考核结合进行。\r\n				</p>\r\n				<p>\r\n					高等学校内设监察部门负责组织对本校信息公开工作的监督检查，监督检查应当有教师、学生和学校其他工作人员代表参加。\r\n				</p>\r\n				<p>\r\n					第二十四条　高等学校应当编制学校上一学年信息公开工作年度报告，并于每年 10 月底前报送所在地省级教育行政部门。中央部门所属高校，还应当报送其上级主管部门。\r\n				</p>\r\n				<p>\r\n					第二十五条 省级教育行政部门应当建立健全高等学校信息公开评议制度，聘请人大代表、政协委员、家长、教师、学生等有关人员成立信息公开评议委员会或者以其他形式，定期对本行政区域内高等学校信息公开工作进行评议，并向社会公布评议结果。\r\n				</p>\r\n				<p>\r\n					第二十六条　公民、法人和其他组织认为高等学校未按照本办法规定履行信息公开义务的，可以向学校内设监察部门、省级教育行政部门举报；对于中央部委所属高等学校，还可向其上级主管部门举报。收到举报的部门应当及时处理，并以适当方式向举报人告知处理结果。\r\n				</p>\r\n				<p>\r\n					第二十七条　高等学校违反有关法律法规或者本办法规定，有下列情形之一的，由省级教育行政部门责令改正；情节严重的，由省级教育行政部门或者国务院教育行政部门予以通报批评；对高等学校直接负责的主管领导和其他直接责任人员，由高等学校主管部门依据有关规定给予处分：\r\n				</p>\r\n				<p>\r\n					（一）不依法履行信息公开义务的；\r\n				</p>\r\n				<p>\r\n					（二）不及时更新公开的信息内容、信息公开指南和目录的；\r\n				</p>\r\n				<p>\r\n					（三）公开不应当公开的信息的；\r\n				</p>\r\n				<p>\r\n					（四）在信息公开工作中隐瞒或者捏造事实的；\r\n				</p>\r\n				<p>\r\n					（五）违反规定收取费用的；\r\n				</p>\r\n				<p>\r\n					（六）通过其他组织、个人以有偿服务方式提供信息的；\r\n				</p>\r\n				<p>\r\n					（七）违反有关法律法规和本办法规定的其他行为的。\r\n				</p>\r\n				<p>\r\n					高等学校上述行为侵害当事人合法权益，造成损失的，应当依法承担民事责任。\r\n				</p>\r\n				<p>\r\n					第二十八条　高等学校应当将开展信息公开工作所需经费纳入年度预算，为学校信息公开工作提供经费保障。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第五章　附则</strong>\r\n				</p>\r\n				<p>\r\n					第二十九条　本办法所称的高等学校，是指大学、独立设置的学院和高等专科学校，其中包括高等职业学校和成人高等学校。\r\n				</p>\r\n				<p>\r\n					高等学校以外其他高等教育机构的信息公开，参照本办法执行。\r\n				</p>\r\n				<p>\r\n					第三十条　已经移交档案工作机构的高等学校信息的公开，依照有关档案管理的法律、法规和规章执行。\r\n				</p>\r\n				<p>\r\n					第三十一条　省级教育行政部门可以根据需要制订实施办法。高等学校应当依据本办法制订实施细则。\r\n				</p>\r\n				<p>\r\n					第三十二条　本办法自 2010 年 9 月 1 日起 施行。\r\n				</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', '', '', '', '1'), ('57', '61', '0', '63', '0', '0', '1414489036', '1414489036', '0', '', '', '中华人民共和国政府信息公开条例', '<table width=\"980\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" style=\"font-family:宋体;\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"font-size:16px;\">\r\n				<p align=\"center\" style=\"font-size:24px;font-weight:bold;\">\r\n					中华人民共和国政府信息公开条例\r\n				</p>\r\n				<p align=\"center\">\r\n					中华人民共和国国务院令第492号\r\n				</p>\r\n				<p align=\"left\">\r\n					《中华人民共和国政府信息公开条例》已经2007年1月17日国务院第165次常务会议通过，现予公布，自2008年5月1日起施行。\r\n				</p>\r\n				<p align=\"right\">\r\n					总　理　 温家宝\r\n				</p>\r\n				<p align=\"right\">\r\n					二○○七年四月五日\r\n				</p>\r\n				<p align=\"center\">\r\n					中华人民共和国政府信息公开条例\r\n				</p>\r\n				<p align=\"center\">\r\n					第一章　总　　则\r\n				</p>\r\n				<p align=\"left\">\r\n					第一条　为了保障公民、法人和其他组织依法获取政府信息，提高政府工作的透明度，促进依法行政，充分发挥政府信息对人民群众生产、生活和经济社会活动的服务作用，制定本条例。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二条　本条例所称政府信息，是指行政机关在履行职责过程中制作或者获取的，以一定形式记录、保存的信息。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三条　各级人民政府应当加强对政府信息公开工作的组织领导。\r\n				</p>\r\n				<p align=\"left\">\r\n					国务院办公厅是全国政府信息公开工作的主管部门，负责推进、指导、协调、监督全国的政府信息公开工作。\r\n				</p>\r\n				<p align=\"left\">\r\n					县级以上地方人民政府办公厅（室）或者县级以上地方人民政府确定的其他政府信息公开工作主管部门负责推进、指导、协调、监督本行政区域的政府信息公开工作。\r\n				</p>\r\n				<p align=\"left\">\r\n					第四条　各级人民政府及县级以上人民政府部门应当建立健全本行政机关的政府信息公开工作制度，并指定机构（以下统称政府信息公开工作机构）负责本行政机关政府信息公开的日常工作。\r\n				</p>\r\n				<p align=\"left\">\r\n					政府信息公开工作机构的具体职责是：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）具体承办本行政机关的政府信息公开事宜；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）维护和更新本行政机关公开的政府信息；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）组织编制本行政机关的政府信息公开指南、政府信息公开目录和政府信息公开工作年度报告；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）对拟公开的政府信息进行保密审查；\r\n				</p>\r\n				<p align=\"left\">\r\n					（五）本行政机关规定的与政府信息公开有关的其他职责。\r\n				</p>\r\n				<p align=\"left\">\r\n					第五条　行政机关公开政府信息，应当遵循公正、公平、便民的原则。\r\n				</p>\r\n				<p align=\"left\">\r\n					第六条　行政机关应当及时、准确地公开政府信息。行政机关发现影响或者可能影响社会稳定、扰乱社会管理秩序的虚假或者不完整信息的，应当在其职责范围内发布准确的政府信息予以澄清。\r\n				</p>\r\n				<p align=\"left\">\r\n					第七条　行政机关应当建立健全政府信息发布协调机制。行政机关发布政府信息涉及其他行政机关的，应当与有关行政机关进行沟通、确认，保证行政机关发布的政府信息准确一致。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关发布政府信息依照国家有关规定需要批准的，未经批准不得发布。\r\n				</p>\r\n				<p align=\"left\">\r\n					第八条　行政机关公开政府信息，不得危及国家安全、公共安全、经济安全和社会稳定。\r\n				</p>\r\n				<p align=\"center\">\r\n					第二章　公开的范围\r\n				</p>\r\n				<p align=\"left\">\r\n					第九条　行政机关对符合下列基本要求之一的政府信息应当主动公开：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）涉及公民、法人或者其他组织切身利益的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）需要社会公众广泛知晓或者参与的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）反映本行政机关机构设置、职能、办事程序等情况的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）其他依照法律、法规和国家有关规定应当主动公开的。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十条　县级以上各级人民政府及其部门应当依照本条例第九条的规定，在各自职责范围内确定主动公开的政府信息的具体内容，并重点公开下列政府信息：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）行政法规、规章和规范性文件；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）国民经济和社会发展规划、专项规划、区域规划及相关政策；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）国民经济和社会发展统计信息；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）财政预算、决算报告；\r\n				</p>\r\n				<p align=\"left\">\r\n					（五）行政事业性收费的项目、依据、标准；\r\n				</p>\r\n				<p align=\"left\">\r\n					（六）政府集中采购项目的目录、标准及实施情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（七）行政许可的事项、依据、条件、数量、程序、期限以及申请行政许可需要提交的全部材料目录及办理情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（八）重大建设项目的批准和实施情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（九）扶贫、教育、医疗、社会保障、促进就业等方面的政策、措施及其实施情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（十）突发公共事件的应急预案、预警信息及应对情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（十一）环境保护、公共卫生、安全生产、食品药品、产品质量的监督检查情况。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十一条　设区的市级人民政府、县级人民政府及其部门重点公开的政府信息还应当包括下列内容：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）城乡建设和管理的重大事项；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）社会公益事业建设情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）征收或者征用土地、房屋拆迁及其补偿、补助费用的发放、使用情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）抢险救灾、优抚、救济、社会捐助等款物的管理、使用和分配情况。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十二条　乡（镇）人民政府应当依照本条例第九条的规定，在其职责范围内确定主动公开的政府信息的具体内容，并重点公开下列政府信息：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）贯彻落实国家关于农村工作政策的情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）财政收支、各类专项资金的管理和使用情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）乡（镇）土地利用总体规划、宅基地使用的审核情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）征收或者征用土地、房屋拆迁及其补偿、补助费用的发放、使用情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（五）乡（镇）的债权债务、筹资筹劳情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（六）抢险救灾、优抚、救济、社会捐助等款物的发放情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（七）乡镇集体企业及其他乡镇经济实体承包、租赁、拍卖等情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（八）执行计划生育政策的情况。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十三条　除本条例第九条、第十条、第十一条、第十二条规定的行政机关主动公开的政府信息外，公民、法人或者其他组织还可以根据自身生产、生活、科研等特殊需要，向国务院部门、地方各级人民政府及县级以上地方人民政府部门申请获取相关政府信息。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十四条　行政机关应当建立健全政府信息发布保密审查机制，明确审查的程序和责任。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关在公开政府信息前，应当依照《中华人民共和国保守国家秘密法》以及其他法律、法规和国家有关规定对拟公开的政府信息进行审查。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关对政府信息不能确定是否可以公开时，应当依照法律、法规和国家有关规定报有关主管部门或者同级保密工作部门确定。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关不得公开涉及国家秘密、商业秘密、个人隐私的政府信息。但是，经权利人同意公开或者行政机关认为不公开可能对公共利益造成重大影响的涉及商业秘密、个人隐私的政府信息，可以予以公开。\r\n				</p>\r\n				<p align=\"center\">\r\n					第三章　公开的方式和程序\r\n				</p>\r\n				<p align=\"left\">\r\n					第十五条　行政机关应当将主动公开的政府信息，通过政府公报、政府网站、新闻发布会以及报刊、广播、电视等便于公众知晓的方式公开。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十六条　各级人民政府应当在国家档案馆、公共图书馆设置政府信息查阅场所，并配备相应的设施、设备，为公民、法人或者其他组织获取政府信息提供便利。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关可以根据需要设立公共查阅室、资料索取点、信息公告栏、电子信息屏等场所、设施，公开政府信息。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关应当及时向国家档案馆、公共图书馆提供主动公开的政府信息。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十七条　行政机关制作的政府信息，由制作该政府信息的行政机关负责公开；行政机关从公民、法人或者其他组织获取的政府信息，由保存该政府信息的行政机关负责公开。法律、法规对政府信息公开的权限另有规定的，从其规定。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十八条　属于主动公开范围的政府信息，应当自该政府信息形成或者变更之日起20个工作日内予以公开。法律、法规对政府信息公开的期限另有规定的，从其规定。\r\n				</p>\r\n				<p align=\"left\">\r\n					第十九条　行政机关应当编制、公布政府信息公开指南和政府信息公开目录，并及时更新。\r\n				</p>\r\n				<p align=\"left\">\r\n					政府信息公开指南，应当包括政府信息的分类、编排体系、获取方式，政府信息公开工作机构的名称、办公地址、办公时间、联系电话、传真号码、电子邮箱等内容。\r\n				</p>\r\n				<p align=\"left\">\r\n					政府信息公开目录，应当包括政府信息的索引、名称、内容概述、生成日期等内容。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十条　公民、法人或者其他组织依照本条例第十三条规定向行政机关申请获取政府信息的，应当采用书面形式（包括数据电文形式）；采用书面形式确有困难的，申请人可以口头提出，由受理该申请的行政机关代为填写政府信息公开申请。\r\n				</p>\r\n				<p align=\"left\">\r\n					政府信息公开申请应当包括下列内容：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）申请人的姓名或者名称、联系方式；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）申请公开的政府信息的内容描述；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）申请公开的政府信息的形式要求。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十一条　对申请公开的政府信息，行政机关根据下列情况分别作出答复：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）属于公开范围的，应当告知申请人获取该政府信息的方式和途径；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）属于不予公开范围的，应当告知申请人并说明理由；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）依法不属于本行政机关公开或者该政府信息不存在的，应当告知申请人，对能够确定该政府信息的公开机关的，应当告知申请人该行政机关的名称、联系方式；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）申请内容不明确的，应当告知申请人作出更改、补充。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十二条　申请公开的政府信息中含有不应当公开的内容，但是能够作区分处理的，行政机关应当向申请人提供可以公开的信息内容。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十三条　行政机关认为申请公开的政府信息涉及商业秘密、个人隐私，公开后可能损害第三方合法权益的，应当书面征求第三方的意见；第三方不同意公开的，不得公开。但是，行政机关认为不公开可能对公共利益造成重大影响的，应当予以公开，并将决定公开的政府信息内容和理由书面通知第三方。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十四条　行政机关收到政府信息公开申请，能够当场答复的，应当当场予以答复。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关不能当场答复的，应当自收到申请之日起15个工作日内予以答复；如需延长答复期限的，应当经政府信息公开工作机构负责人同意，并告知申请人，延长答复的期限最长不得超过15个工作日。\r\n				</p>\r\n				<p align=\"left\">\r\n					申请公开的政府信息涉及第三方权益的，行政机关征求第三方意见所需时间不计算在本条第二款规定的期限内。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十五条　公民、法人或者其他组织向行政机关申请提供与其自身相关的税费缴纳、社会保障、医疗卫生等政府信息的，应当出示有效身份证件或者证明文件。\r\n				</p>\r\n				<p align=\"left\">\r\n					公民、法人或者其他组织有证据证明行政机关提供的与其自身相关的政府信息记录不准确的，有权要求该行政机关予以更正。该行政机关无权更正的，应当转送有权更正的行政机关处理，并告知申请人。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十六条　行政机关依申请公开政府信息，应当按照申请人要求的形式予以提供；无法按照申请人要求的形式提供的，可以通过安排申请人查阅相关资料、提供复制件或者其他适当形式提供。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十七条　行政机关依申请提供政府信息，除可以收取检索、复制、邮寄等成本费用外，不得收取其他费用。行政机关不得通过其他组织、个人以有偿服务方式提供政府信息。\r\n				</p>\r\n				<p align=\"left\">\r\n					行政机关收取检索、复制、邮寄等成本费用的标准由国务院价格主管部门会同国务院财政部门制定。\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十八条　申请公开政府信息的公民确有经济困难的，经本人申请、政府信息公开工作机构负责人审核同意，可以减免相关费用。\r\n				</p>\r\n				<p align=\"left\">\r\n					申请公开政府信息的公民存在阅读困难或者视听障碍的，行政机关应当为其提供必要的帮助。\r\n				</p>\r\n				<p align=\"center\">\r\n					第四章　监督和保障\r\n				</p>\r\n				<p align=\"left\">\r\n					第二十九条　各级人民政府应当建立健全政府信息公开工作考核制度、社会评议制度和责任追究制度，定期对政府信息公开工作进行考核、评议。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十条　政府信息公开工作主管部门和监察机关负责对行政机关政府信息公开的实施情况进行监督检查。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十一条　各级行政机关应当在每年3月31日前公布本行政机关的政府信息公开工作年度报告。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十二条　政府信息公开工作年度报告应当包括下列内容：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）行政机关主动公开政府信息的情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）行政机关依申请公开政府信息和不予公开政府信息的情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）政府信息公开的收费及减免情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）因政府信息公开申请行政复议、提起行政诉讼的情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（五）政府信息公开工作存在的主要问题及改进情况；\r\n				</p>\r\n				<p align=\"left\">\r\n					（六）其他需要报告的事项。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十三条　公民、法人或者其他组织认为行政机关不依法履行政府信息公开义务的，可以向上级行政机关、监察机关或者政府信息公开工作主管部门举报。收到举报的机关应当予以调查处理。\r\n				</p>\r\n				<p align=\"left\">\r\n					公民、法人或者其他组织认为行政机关在政府信息公开工作中的具体行政行为侵犯其合法权益的，可以依法申请行政复议或者提起行政诉讼。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十四条　行政机关违反本条例的规定，未建立健全政府信息发布保密审查机制的，由监察机关、上一级行政机关责令改正；情节严重的，对行政机关主要负责人依法给予处分。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十五条　行政机关违反本条例的规定，有下列情形之一的，由监察机关、上一级行政机关责令改正；情节严重的，对行政机关直接负责的主管人员和其他直接责任人员依法给予处分；构成犯罪的，依法追究刑事责任：\r\n				</p>\r\n				<p align=\"left\">\r\n					（一）不依法履行政府信息公开义务的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（二）不及时更新公开的政府信息内容、政府信息公开指南和政府信息公开目录的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（三）违反规定收取费用的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（四）通过其他组织、个人以有偿服务方式提供政府信息的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（五）公开不应当公开的政府信息的；\r\n				</p>\r\n				<p align=\"left\">\r\n					（六）违反本条例规定的其他行为。\r\n				</p>\r\n				<p align=\"center\">\r\n					第五章　附　　则\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十六条　法律、法规授权的具有管理公共事务职能的组织公开政府信息的活动，适用本条例。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十七条　教育、医疗卫生、计划生育、供水、供电、供气、供热、环保、公共交通等与人民群众利益密切相关的公共企事业单位在提供社会公共服务过程中制作、获取的信息的公开，参照本条例执行，具体办法由国务院有关主管部门或者机构制定。\r\n				</p>\r\n				<p align=\"left\">\r\n					第三十八条　本条例自2008年5月1日起施行。\r\n				</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', '', '', '', '1'), ('48', '61', '0', '63', '0', '0', '1414137784', '1414489002', '0', '', '', '中国矿业大学（北京）信息公开实施办法（试行）', '<table width=\"980\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\" style=\"font-family:宋体;\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"font-size:16px;\">\r\n				<p align=\"center\">\r\n					<strong>中国矿业大学（北京）信息公开实施办法（试行）</strong>\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第一章 总 则</strong>\r\n				</p>\r\n				<p>\r\n					<strong> 第一条&nbsp;</strong>为了保障公民、法人和其他组织依法获取学校信息，促进依法治校，根据《中华人民共和国政府信息公开条例》和《高等学校信息公开办法》，结合学校实际，制定本办法。\r\n				</p>\r\n				<p>\r\n					<strong>第二条&nbsp;</strong>本办法中所称学校信息，是指学校在开展办学活动和提供社会公共服务过程中产生、制作、获取的以一定形式记录、保存的信息。\r\n				</p>\r\n				<p>\r\n					<strong>第三条&nbsp;</strong>学校成立信息公开领导小组（以下简称领导小组），全面负责学校信息公开工作。包括审定信息公开工作规划和有关制度，协调推进信息公开工作部署，研究决定信息公开工作中的重大问题，指导并推动各单位的信息公开工作等。\r\n				</p>\r\n				<p>\r\n					<strong>第四条&nbsp;</strong>领导小组下设信息公开办公室，具体负责学校信息公开的日常工作。办公室设在党政办公室，其主要职责是：\r\n				</p>\r\n				<p>\r\n					（一）具体承办学校信息公开事宜；&nbsp;<br />\r\n（二）管理、协调、维护和更新学校公开的信息；&nbsp;<br />\r\n（三）统一受理、协调处理、统一答复向学校提出的信息公开申请；&nbsp;<br />\r\n（四）组织编制学校的信息公开指南、信息公开目录和信息公开工作年度报告；&nbsp;<br />\r\n（五）推进、协调学校各职能部门、各学院的信息公开；&nbsp;<br />\r\n（六）协调对拟公开的学校信息进行保密审查；&nbsp;<br />\r\n（七）承担与学校信息公开有关的其他职责。\r\n				</p>\r\n				<p>\r\n					<strong>第五条&nbsp;</strong>学校各单位主要负责人领导本单位信息公开工作。各单位要明确专人负责本单位信息公开的具体工作，并要根据本办法，逐步建立健全本单位的信息公开制度，明确信息公开的具体内容。\r\n				</p>\r\n				<p>\r\n					<strong>第六条&nbsp;</strong>信息公开工作应当遵循公正、公平、便民的原则。公开的信息不得危及国家安全、公共安全、经济安全、社会稳定和学校安全稳定。\r\n				</p>\r\n				<p>\r\n					<strong> 第七条&nbsp;</strong>学校各单位发现影响或者可能影响社会稳定、扰乱社会管理秩序的虚假或者不完整信息的，应当在职责范围内发布准确的信息予以澄清。\r\n				</p>\r\n				<p>\r\n					<strong> 第八条&nbsp;</strong>学校各单位发布信息涉及其他单位的，应当积极主动与有关单位进行沟通、确认，以确保发布信息的准确一致。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第二章 公开的内容</strong>\r\n				</p>\r\n				<p>\r\n					<strong> 第九条&nbsp;</strong>学校信息分为主动公开、依申请公开和不予公开三种属性。各单位在起草信息时应当明确信息的公开属性。\r\n				</p>\r\n				<p>\r\n					<strong> 第十条&nbsp;</strong>学校下列信息应当主动公开：\r\n				</p>\r\n				<p>\r\n					（一）学校名称、办学地点、办学性质、办学宗旨、办学层次、办学规模，内部管理体制、机构设置、学校领导等基本情况； 　　&nbsp;<br />\r\n（二）学校章程以及学校制定的各项规章制度；<br />\r\n（三）学校发展规划和年度工作计划；<br />\r\n（四）各层次、类型学历教育招生、考试与录取规定，学籍管理、学位评定办法，学生申诉途径与处理程序；毕业生就业指导与服务情况等;&nbsp;<br />\r\n（五）学科与专业设置，重点学科建设情况，课程与教学计划，实验室、仪器设备配置与图书藏量，教学与科研成果评选，国家组织的教学评估结果等； 　　&nbsp;<br />\r\n（六）学生奖学金、助学金、学费减免、助学贷款与勤工俭学的申请与管理规定等； 　　&nbsp;<br />\r\n（七）教师和其他专业技术人员数量、专业技术职务等级，岗位设置管理与聘用办法，教师争议解决办法等 ;&nbsp;<br />\r\n（八）收费的项目、依据、标准与投诉方式； 　&nbsp;<br />\r\n（九）财务、资产与财务管理制度，学校经费来源、年度经费预算决算方案，财政性资金、受捐赠财产的使用与管理情况，仪器设备、图书、药品等物资设备采购和重大基建工程的招投标； 　&nbsp;<br />\r\n（十）自然灾害等突发事件的应急处理预案、处置情况，涉及学校的重大事件的调查和处理情况； 　　&nbsp;<br />\r\n（十一）对外交流与中外合作办学情况，外籍教师与留学生的管理制度； 　　&nbsp;<br />\r\n（十二）法律、法规和规章规定需要公开的其他事项。\r\n				</p>\r\n				<p>\r\n					<strong>第十一条&nbsp;</strong>除学校已公开的信息外，公民、法人和其他组织还可以根据自身学习、科研、工作等特殊需要，以书面形式（包括数据电文形式）向学校申请获取相关信息。\r\n				</p>\r\n				<p>\r\n					<strong>第十二条&nbsp;</strong>学校对下列信息不予公开：\r\n				</p>\r\n				<p>\r\n					（一）涉及国家秘密的；&nbsp;<br />\r\n（二）涉及商业秘密的；　　&nbsp;<br />\r\n（三）涉及个人隐私的；　&nbsp;<br />\r\n（四）正在调查、讨论、审议、处理过程中的不确定性信息；&nbsp;<br />\r\n（五）法律、法规和规章以及学校规定的不予公开的其他信息。&nbsp;<br />\r\n其中第（二）项、第（三）项所列的信息，经权利人同意公开或者学校认为不公开可能对公共利益造成重大影响的，可以予以公开。<strong></strong>\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第三章 公开的途径和要求</strong>\r\n				</p>\r\n				<p>\r\n					<strong> 第十三条&nbsp;</strong>学校主动公开的信息，应当根据实际情况，通过以下一种或几种方式进行公开：\r\n				</p>\r\n				<p>\r\n					（一）学校网站、校报校刊、校内广播等校内媒体；&nbsp;<br />\r\n（二）报刊、杂志、广播、电视等校外媒体；&nbsp;<br />\r\n（三）新闻发布会、年鉴、会议纪要或者简报等方式；&nbsp;<br />\r\n（四）其他便于公众及时、准确获取信息的方式。\r\n				</p>\r\n				<p>\r\n					<strong> 第十四条&nbsp;</strong>党政办公室负责组织编制《中国矿业大学（北京）信息公开指南》（以下简称《信息公开指南》）和《中国矿业大学（北京）信息公开目录》（以下简称《信息公开目录》），并且根据需要及时更新。各单位应当在本单位职责范围内，根据《信息公开指南》和《信息公开目录》的要求，及时主动公开信息。\r\n				</p>\r\n				<p>\r\n					<strong> 第十五条&nbsp;</strong>各单位完成信息制作或者获取信息后，应当及时明确该信息是否公开。确定公开的，应当明确公开的受众；确定不予公开的，应当说明理由；难以确定是否公开的，应当及时报请上级有关部门审定。\r\n				</p>\r\n				<p>\r\n					<strong> 第十六条&nbsp;</strong>凡 属于主动公开的信息，信息拥有单位应当自该信息制作完成或者获取之日起 20 个工作日内予以公开。公开的信息内容发生变更的，应当在变更后 20 个工作日内予以更新。\r\n				</p>\r\n				<p>\r\n					法律法规对信息内容公开的期限另有规定的，从其规定。\r\n				</p>\r\n				<p>\r\n					<strong> 第十七条&nbsp;</strong>申请公开学校层面的信息，由党政办公室统一受理、统一答复；申请公开有关单位内部的信息，由各单位受理和答复。对申请人的信息公开申请，根据下列情况在 15 个工作日内分别作出答复：\r\n				</p>\r\n				<p>\r\n					（一）属于公开范围的，应当告知申请人获取该信息的方式和途径；&nbsp;<br />\r\n（二）属于不予公开范围的，应当告知申请人并说明理由；&nbsp;<br />\r\n（三）不属于学校职责范围的或者该信息不存在的，应当告知申请人，对能够确定该信息的职责单位的，应当告知申请人该单位的名称、联系方式；&nbsp;<br />\r\n（四）申请公开的信息含有不应当公开的内容但能够区分处理的，应当告知申请人并提供可以公开的信息内容，对不予公开的部分，应当说明理由；&nbsp;<br />\r\n（五）申请内容不明确的，应当告知申请人作出更改、补充；申请人逾期未补正的，视为放弃本次申请；&nbsp;<br />\r\n（六）同一申请人无正当理由重复向学校申请公开同一信息，学校已经作出答复且该信息未发生变化的，应当告知申请人，不再重复处理；&nbsp;<br />\r\n（七）学校根据实际情况作出的其他答复。\r\n				</p>\r\n				<p>\r\n					<strong> 第十八条&nbsp;</strong>申请人向学校申请公开信息的，应当出示有效身份证件或者证明文件。\r\n				</p>\r\n				<p>\r\n					申请人有证据证明学校提供的与自身相关的信息记录不准确的，有权要求学校予以更正；学校无权更正的，应当转送有权更正的单位处理，并告知申请人。\r\n				</p>\r\n				<p>\r\n					<strong> 第十九条&nbsp;</strong>学校处理信息公开申请需要收费的，按国家有关规定执行。\r\n				</p>\r\n				<p>\r\n					<strong> 第二十条&nbsp;</strong>学校建立健全信息发布保密审查机制。学校 各单位在公开信息前，应当依照法律法规和学校有关规定对拟公开的信息进行保密审查。按照“谁公开，谁负责”的原则，由各单位负责人审查确定是否公开。如对信息不能确定是否可以公开时，应当报党政办公室和保密委员会办公室审查。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第四章 监督和保障</strong>\r\n				</p>\r\n				<p>\r\n					<strong> 第二十一条&nbsp;</strong>学校将信息公开工作纳入干部岗位责任考核内容。信息公开实施情况是评价各单位及其负责人年度工作业绩的一项指标。\r\n				</p>\r\n				<p align=\"left\">\r\n					<strong> 第二十二条&nbsp;</strong>纪委、监察处负责对信息公开工作进行监督检查。\r\n				</p>\r\n				<p>\r\n					<strong> 第二十三条&nbsp;</strong> 学校在每年 10 月底前编制学校上一学年的信息公开工作年度报告。各单位应在每年 9 月底前将本单位上一学年信息公开的有关情况和本学年信息公开工作计划按要求报学校信息公开办公室。\r\n				</p>\r\n				<p>\r\n					<strong> 第二十四条&nbsp;</strong>各单位在信息公开工作中应自觉接受学校师生员工及社会各界的监督，了解服务对象对信息公开工作的反映，对发现和存在的问题应当认真研究，积极整改。\r\n				</p>\r\n				<p align=\"center\">\r\n					<strong>第五章 附 则</strong>\r\n				</p>\r\n				<p align=\"left\">\r\n					<strong> 第二十五条&nbsp;</strong>已经移交档案部门的学校信息的公开，依照有关档案管理的法律、法规和规章执行。\r\n				</p>\r\n				<p>\r\n					<strong> 第二十六条&nbsp;</strong>本办法由学校党政办公室负责解释。\r\n				</p>\r\n				<p align=\"left\">\r\n					<strong> 第二十七条&nbsp;</strong>本办法自发布之日起施行。\r\n				</p>\r\n				<p>\r\n					&nbsp;\r\n				</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '见习生助理', '', '见习生助理', '', '1');
INSERT INTO `my_articles` VALUES ('52', '61', '0', '0', '0', '0', '1414395743', '1414395743', '0', '', '', '三级职员岗位聘任人选公示', '<p style=\"text-align:center;\" class=\"MsoNormal\" align=\"center\">\r\n	<b><span style=\"font-size:18px;font-family:FangSong_GB2312;\">三级职员岗位聘任人选公示</span></b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">根据《关于开展三级、四级职员聘任工作的通知》（中矿京党字</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">[2014]13</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">号）精神，在个人申请、资格审查、民主测评、学校聘任工作委员会无记名投票确定建议人选的基础上，经</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">2014</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">年</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">7</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">月</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">9</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">日学校党委常委会研究决定，拟聘任范迅同志为三级职员，现予以公示。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">公示时间：</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">2014</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">年</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">7</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">月</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">9</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">日</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">-7</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">月</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">15</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">日</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">公示期间，学校任何单位和个人均可通过来电、来信、来访等方式向纪委、党委组织部反映公示对象在德、能、勤、绩、廉等方面存在的有关问题。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">联系电话：</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">62331431</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">（纪委）</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\"> 62331206</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">、</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">62339996</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">（组织部）</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">联系地址：</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">1</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">号办公楼</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">101</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">、</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">301</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">、</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">302</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">房间</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">网上举报：</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">jjsc@cumtb.edu.cn&nbsp; \r\nzzb@cumtb.edu.cn</span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">反映情况和问题应实事求是，客观公正。为便于核实、反馈有关情况，提倡反映人提供真实姓名、联系方式或工作单位。我们将严格遵守工作纪律，履行保密义务。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">特此公示。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:185.45pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">&nbsp;</span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:185.45pt;\" class=\"MsoNormal\" align=\"center\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">中共中国矿业大学（北京）委员会</span><span></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:185.45pt;\" class=\"MsoNormal\" align=\"center\">\r\n	<span style=\"font-size:18px;font-family:FangSong_GB2312;\">2014年</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">7</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">月</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">9</span><span style=\"font-size:18px;font-family:FangSong_GB2312;\">日</span><span></span>\r\n</p>', '', '', '', '', '1'), ('78', '3', '0', '26', '74', '0', '1414811664', '1414814145', '0', '', '', '现金使用与管理情况', '测试！', '', '', '', '', '9'), ('80', '1', '0', '11', '0', '0', '1414812609', '1414812609', '0', '', '', '学校机构设置（测试）', '<a class=\"ke-insertfile\" href=\"/uploads/file/新建MicrosoftWord文档.doc\" target=\"_blank\">学校机构设置</a>', '', '', '', '', '2'), ('60', '61', '0', '272', '0', '0', '1414549818', '1414810389', '0', '', '', '关于申报2015年度外国文教专家聘请计划的通知', '<table width=\"98%\" align=\"center\" class=\"ke-zeroborder\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<br />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<table width=\"100%\" align=\"center\" class=\"ke-zeroborder\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td width=\"100%\" align=\"middle\">\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td class=\"newstitle\" id=\"fontzoom\" valign=\"top\">\r\n								<!-- 文章内容 start -->\r\n								<div>\r\n									<div>\r\n										<div>\r\n											<div class=\"STYLE16\">\r\n												<p>\r\n													<span style=\"font-size:14px;\">根据国家外国专家局和教育部相关文件精神，我校2015年度聘请外国文教专家项目申报工作即将开始。此次我校申报的外国文教专家聘请计划分为五类： </span><br />\r\n<span style=\"font-size:14px;\"> 1、聘请对象为某一学科或者专业领域具有国际公认的较高学术造诣的外籍专家或者学者，</span><strong><span style=\"font-size:14px;\">每年来华累计时间不少于</span></strong><strong><span style=\"font-size:14px;\">60</span></strong><strong><span style=\"font-size:14px;\">天</span></strong><span style=\"font-size:14px;\">，可以申报</span><strong><span style=\"font-size:14px;\">“海外名师项目”</span></strong><span style=\"font-size:14px;\">。 </span><br />\r\n<span style=\"font-size:14px;\"> 2、通过具有鲜明特征或者独特运作方式实施的聘请</span><strong><span style=\"font-size:14px;\">外国文教专家和外籍教师团队（不少于三名知名专家）</span></strong><span style=\"font-size:14px;\">从事教学、科研、社会服务和管理等工作的项目，尤其是聚焦某一方面或者某一领域实现不断改进和持续进步的，可以申报</span><strong><span style=\"font-size:14px;\">“学校特色项目”</span></strong><span style=\"font-size:14px;\">。 </span><br />\r\n<span style=\"font-size:14px;\"> 3、根据学科发展和人才培养的实际需要，各单位负责人或者学科带头人可以联合校内（支持跨部门）相关领域教师共同聘请</span><strong><span style=\"font-size:14px;\">四人以上的专家团队</span></strong><span style=\"font-size:14px;\">申报</span><strong><span style=\"font-size:14px;\">“引智平台项目”</span></strong><span style=\"font-size:14px;\">，用于促进相关学科的科研发展、人才培养和科研团队建设。 </span><br />\r\n<span style=\"font-size:14px;\"> 4、其他涉及国家级、省部级重点项目，高层次人才培养项目，高新技术开发、产学研结合项目，高校重点学科、新兴学科、交叉学科和重点实验室建设等项目，需要聘请外国文教专家的，可以申报</span><strong><span style=\"font-size:14px;\">“学校重点外专引智项目”</span></strong><span style=\"font-size:14px;\">。 </span><br />\r\n<span style=\"font-size:14px;\"> 5、聘请对象为国外院校或科研机构普通学者或研究人员的，可以申报</span><strong><span style=\"font-size:14px;\">“聘请外国文教专家普通常规项目”</span></strong><span style=\"font-size:14px;\">。 </span><br />\r\n<span style=\"font-size:14px;\"> 6、上述五类项目对比情况参见下文所附《各类引智项目对比表》。</span> \r\n												</p>\r\n												<p>\r\n													<span style=\"font-size:14px;\">请有意于2015年度聘请外专的老师于8月30日前联系所在学院主管外事负责人或我处索取相关材料，所有申报材料必须纳入所在学院的《2015年度外专聘请计划汇总表》。 </span><br />\r\n<span style=\"font-size:14px;\"> 2015年度外专经费的支出将严格参照申报计划执行。没有申报计划的聘请外专引智任务，我处将不再予以经费支持。</span> \r\n												</p>\r\n												<p>\r\n													<span style=\"font-size:14px;\">联系人：杨英、王红梅 </span><br />\r\n<span style=\"font-size:14px;\">办公地点：1号办公楼107室、105室</span><br />\r\n<span style=\"font-size:14px;\">电话：62331301/62339599</span><br />\r\n<span style=\"font-size:14px;\">电子邮箱：</span><a href=\"mailto:yangying@cumtb.edu.cn\"><span style=\"font-size:14px;\">yangying@cumtb.edu.cn</span></a> \r\n												</p>\r\n<a class=\"STYLE15\" href=\"http://international.cumtb.edu.cn/gywm/20140709geleiyinzhixiangmuduibibiao.doc\" target=\"_blank\"><span style=\"font-size:14px;\">附件：各类引智项目对比表</span></a><br />\r\n												<p>\r\n													<span style=\"font-size:14px;\">&nbsp;</span> \r\n												</p>\r\n												<p align=\"right\">\r\n													<span class=\"STYLE15\"><span style=\"font-size:14px;\">中国矿业大学（北京）</span><br />\r\n<span style=\"font-size:14px;\">国际合作与交流处</span><br />\r\n<span style=\"font-size:14px;\">二〇一四年七月二日</span></span> \r\n												</p>\r\n											</div>\r\n										</div>\r\n									</div>\r\n								</div>\r\n<br />\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />', '', '', '', '', '1'), ('61', '61', '0', '64', '0', '0', '1414569323', '1414569323', '0', '', '', '三级职员岗位聘任人选公示', '<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">根据《关于开展三级、四级职员聘任工作的通知》（中矿京党字</span><span style=\"font-size:16px;\">[2014]13</span><span style=\"font-size:16px;\">号）精神，在个人申请、资格审查、民主测评、学校聘任工作委员会无记名投票确定建议人选的基础上，经</span><span style=\"font-size:16px;\">2014</span><span style=\"font-size:16px;\">年</span><span style=\"font-size:16px;\">7</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">9</span><span style=\"font-size:16px;\">日学校党委常委会研究决定，拟聘任范迅同志为三级职员，现予以公示。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">公示时间：</span><span style=\"font-size:16px;\">2014</span><span style=\"font-size:16px;\">年</span><span style=\"font-size:16px;\">7</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">9</span><span style=\"font-size:16px;\">日</span><span style=\"font-size:16px;\">-7</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">15</span><span style=\"font-size:16px;\">日</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">公示期间，学校任何单位和个人均可通过来电、来信、来访等方式向纪委、党委组织部反映公示对象在德、能、勤、绩、廉等方面存在的有关问题。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">联系电话：</span><span style=\"font-size:16px;\">62331431</span><span style=\"font-size:16px;\">（纪委）</span><span style=\"font-size:16px;\"> 62331206</span><span style=\"font-size:16px;\">、</span><span style=\"font-size:16px;\">62339996</span><span style=\"font-size:16px;\">（组织部）</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">联系地址：</span><span style=\"font-size:16px;\">1</span><span style=\"font-size:16px;\">号办公楼</span><span style=\"font-size:16px;\">101</span><span style=\"font-size:16px;\">、</span><span style=\"font-size:16px;\">301</span><span style=\"font-size:16px;\">、</span><span style=\"font-size:16px;\">302</span><span style=\"font-size:16px;\">房间</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">网上举报：</span><span style=\"font-size:16px;\">jjsc@cumtb.edu.cn&nbsp; \r\nzzb@cumtb.edu.cn</span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">反映情况和问题应实事求是，客观公正。为便于核实、反馈有关情况，提倡反映人提供真实姓名、联系方式或工作单位。我们将严格遵守工作纪律，履行保密义务。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">特此公示。</span><span></span>\r\n</p>\r\n<p style=\"text-indent:185.45pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">&nbsp;</span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:185.45pt;\" class=\"MsoNormal\" align=\"center\">\r\n	<span style=\"font-size:16px;\">中共中国矿业大学（北京）委员会</span><span></span>\r\n</p>\r\n<p style=\"text-align:center;text-indent:185.45pt;\" class=\"MsoNormal\" align=\"center\">\r\n	<span style=\"font-size:16px;\">2014年</span><span style=\"font-size:16px;\">7</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">9</span><span style=\"font-size:16px;\">日</span><span></span>\r\n</p>', '', '', '', '', '1'), ('62', '61', '0', '64', '0', '0', '1414569366', '1414569366', '0', '', '', '公示公告', '<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">按照《关于公开选聘后勤处科级干部的通知》（中矿京党字</span><span style=\"font-size:16px;\">[2014]19</span><span style=\"font-size:16px;\">号）文件要求，在本人申请、资格审查、面试答辩的基础上，校公开招聘工作小组确定了考察人选。经组织考察，</span><span style=\"font-size:16px;\">2014</span><span style=\"font-size:16px;\">年</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">22</span><span style=\"font-size:16px;\">日校党委常委会议研究确定了拟任职人选。为在学校干部选拔任用工作中进一步扩大民主，广泛听取教职员工的意见，决定对后勤处学生公寓管理中心主任、运行管理科副科长拟任职人选予以公示。</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:30.1pt;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">一、公示人选与职务</span><span></span></b>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">王泽惠为后勤处学生公寓管理中心主任（正科级）</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">董</span><span style=\"font-size:16px;\">&nbsp; </span><span style=\"font-size:16px;\">辉为后勤处运行管理科副科长</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">二、公示期限</span><span></span></b>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">2014年</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">22</span><span style=\"font-size:16px;\">日至</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">28</span><span style=\"font-size:16px;\">日</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">三、反映意见的方式</span><span></span></b>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">在公示期内，学校任何单位和个人如对公示对象有异议，可通过来信、来电、来访、电子邮件等方式向校党委组织部和纪委反映问题和意见。联系电话：</span><span style=\"font-size:16px;\">62331206</span><span style=\"font-size:16px;\">，</span><span style=\"font-size:16px;\">62339996</span><span style=\"font-size:16px;\">（组织部），</span><span style=\"font-size:16px;\">62331431</span><span style=\"font-size:16px;\">（纪委办公室），电子邮件：</span><span style=\"font-size:16px;\">zzb@cumtb.edu.cn</span><span style=\"font-size:16px;\">，</span><span style=\"font-size:16px;\">jjsc@cumtb.edu.cn</span><span style=\"font-size:16px;\">。</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<b><span style=\"font-size:16px;\">四、对反映意见的要求</span><span></span></b>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">反映意见要本着对学校和干部本人高度负责的态度，内容要实事求是、具体、详实、准确。</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">1．以单位（部门）名义反映意见的要加盖单位公章；</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">2．以个人名义反映意见的应署真实姓名、单位和联系方式；</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">3．反映问题中，涉及时间、地点、经过、证人等要事实清楚或基本清楚；</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">4．对无实质性内容的匿名信、来电和来访一般不作调查。对虽未署名，但反映问题线索清楚、有据可查的，要及时进行核实。</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">5．接待单位和个人对群众反映的问题要严格保密。</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">特此公告</span><span></span>\r\n</p>\r\n<p style=\"text-align:left;text-indent:28.8pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">&nbsp;</span>\r\n</p>\r\n<p style=\"text-align:right;text-indent:182.7pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">中共中国矿业大学（北京）委员会</span><span></span>\r\n</p>\r\n<p style=\"text-align:right;text-indent:224pt;\" class=\"MsoNormal\">\r\n	<span style=\"font-size:16px;\">2014年</span><span style=\"font-size:16px;\">10</span><span style=\"font-size:16px;\">月</span><span style=\"font-size:16px;\">22</span><span style=\"font-size:16px;\">日</span><span></span>\r\n</p>', '', '', '', '', '1'), ('63', '61', '0', '272', '0', '0', '1414569868', '1414569868', '0', '', '', '关于联合召开2014年全国矿山建设学术会议的通知', '<div class=\"WordSection1\">\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		<b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</b><b>煤矿建设与岩土工程专业委员会</b><b></b>\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		<img width=\"631\" height=\"2\" src=\"file://C:/DOCUME~1/DELL/LOCALS~1/Temp/msohtmlclip1/01/clip_image001.gif\" />&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		<b>&nbsp;</b>\r\n	</p>\r\n<br />\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		关于联合召开<span>2014</span>年全国矿山建设学术会议的通知<span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		<b><br />\r\n</b>（第<span>2</span>号通知）<span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		各有关单位：<span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		由中国煤炭学会煤矿建设与岩土工程专业委员会主办，中国矿业大学（北京）力学与建筑工程学院、天地科技建井研究院承办，华煤集团有限公司、北京华培中创文化发展有限公司等单位协办的2014年全国矿山建设学术研讨会，定于10月17～20日在北京召开，具体通知如下：\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.1pt;\">\r\n		<b>一、会议内容</b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		会议围绕矿山工程建设领域的技术进步和前瞻性问题进行交流、研讨。邀请业界知名专家做专题报告，优秀论文作者进行发言，介绍有推广价值的新技术、新工艺和新产品，就热点技术问题进行讨论。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.1pt;\">\r\n		<b>二、会议安排</b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		1. 会期\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月17日报到（交费、领资料、安排房间、订返程票等）；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月18日～19日&nbsp; 大会报告、学术讲座、论文交流；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月20日返程。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		2. 会议地点\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		中国矿业大学（北京）国际学术交流中心；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		地址：北京市海淀区学院路丁11号\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		※距离北京西站15.4公里，乘坐出租车约30分钟（40元左右）；距离北京站20公里，乘坐出租车约30分钟（50元左右）；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		※距离首都机场30.0公里，乘坐出租车约40分钟（100元左右）；或由机场乘坐机场大巴5线至北航（北门）下，换成出租车约10分钟（15元左右）。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.1pt;\">\r\n		<b>三、会议费用及其他</b>\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		1. 会务费\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		代表：会务费1650元/人（含资料费等）；陪同：650元/人；住宿费自理。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		2. 回执确认\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		为确保会议代表用房，请与会代表及随行人员务必于10月10日前，将参会回执（见附件1）以电子邮件或传真方式发送至会务组：\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		参会回执接收方式:\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		邮箱：wqfei@cumtb.edu.cn；&nbsp; 传真：010-62331679\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		如有疑问或其他事宜，请向会务筹备组联系人电话咨询：\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		王老师13167562707，13701263782；孙老师18010150858；杨老师18600987279。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		3. 会议报告\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		论文交流发言：优秀论文作者代表原则上要进行发言交流，其他有意进行会议发言的请提前将发言题目填写在会议回执中，由大会统一安排。所有发言者要制作演示幻灯片,做好会上交流发言准备（发言时间原则上不超过15分钟），演示材料请于10月10日前交传至会务组。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		4. 其他\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		本次会议原则上不安排接机、接站，有特别要求的人员可以与会务组联系。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		主办单位：中国煤炭学会煤矿建设与岩土工程专业委员会\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		承办单位：中国矿业大学（北京）力学与建筑工程学院\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n天地科技建井研究院\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		协办单位：华煤集团有限公司\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n北京华培中创文化发展有限公司\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014年9月1日<b></b>\r\n	</p>\r\n</div>\r\n<p style=\"text-indent:2em;\">\r\n	<b><br />\r\n</b> \r\n</p>\r\n<div class=\"WordSection2\">\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		会议注意事项<span></span>\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		一、会议期间具体日程安排\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月17日&nbsp; 报到（交费、领资料、安排房间、订返程票等）；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月18日～19日&nbsp; 正式会议；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		10月20日会议结束，返程。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		二、会议考察\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		参会人员如有考察需要，考察地点安排等另行协商。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		三、票务\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		您可以自行提前预定好返程车票和机票，也可以选择承办单位进行车票和机票的预定。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		四、住宿费\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		1.10月17日～20日，中国矿业大学（北京）国际交流中心住宿费标准间268元/天.间（含早餐），单间和套间另计；西郊宾馆标准间350-420元/天。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		2. 会务费\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		代表1650元/人（含资料费、会议费用等），随行人员650元/人。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		五、其他\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		1.10月20日早餐后，自行安排行程；\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		2. 因气候多变，请与会人员携带必要衣物和常用药物。\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\" style=\"text-indent:28.0pt;\">\r\n		&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;2014年9月1日\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<span>&nbsp;</span>\r\n	</p>\r\n</div>\r\n<p style=\"text-indent:2em;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;text-indent:2em;\">\r\n	<b>附件</b><b>1</b><b>：</b><b>2014</b><b>年全国矿山建设学术会议参加回执单</b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;text-indent:2em;\">\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	经研究，我单位拟派下列人员出席<span>2014</span>年矿山建设学术会议。\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:2em;\">\r\n	<table class=\"MsoNormalTable ke-zeroborder\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n		<tbody>\r\n			<tr>\r\n				<td width=\"82\" style=\"border:solid black 1.0pt;background:white;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;\">\r\n						<span style=\"font-size:12.0pt;font-family:仿宋_GB2312;\">代表姓名</span><span style=\"font-family:仿宋_GB2312;\"></span>\r\n					</p>\r\n				</td>\r\n				<td width=\"46\" style=\"border:solid black 1.0pt;background:white;\">\r\n					<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:-16.5pt;text-align:center;text-indent:16.45pt;\">\r\n						<span style=\"font-size:12.0pt;font-family:仿宋_GB2312;\">性别</span><span style=\"font-family:仿宋_GB2312;\"></span>\r\n					</p>\r\n				</td>\r\n				<td width=\"168\" style=\"border:solid black 1.0pt;backgrou