n></b>\r\n	</p>\r\n	<p style=\"text-indent:31.45pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		纪委，各分党委（党总支）、党委各部门，工会，团委，各有关单位：<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		由于学校后勤处部分管理岗位人员出现较大空缺，为及时补充必要的管理人员，为学校发展提供可靠后勤保障，经校党委常委会议研究，决定在全校范围内公开选聘<span>2</span>名科级干部。根据学校干部选拔聘任的有关规定，现将有关事项通知如下：<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		一、选聘岗位及职数<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		后勤处办公室主任（或副主任）<span>1</span>名，学生公寓管理中心主任或运行管理科科长（或副科长）<span>1</span>名。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		二、岗位职责<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		（一）办公室主任（或副主任）<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		负责后勤处的内外联络与协调，信息统计、报送与发布，督促各单位开展工作，各类文件的收发及处理；后勤工作计划、总结、报告及有关材料的起草；文件、合同、图纸等档案管理；后勤信息化管理、数字后勤建设，网站维护；后勤物资采购及管理，后勤房产及其他固定资产设备管理，校内商业经营项目管理；协助后勤及产业党总支、后勤分工会开展工作，开展后勤精神文明及文化建设等。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		（二）学生公寓管理中心主任或运行管理科科长（或副科长）<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		学生公寓管理中心主任负责制定学生公寓住宿规划和管理服务规范；开展公寓床位管理、门卫管理，维护公寓秩序；负责公寓设备设施维护、日常零修及公寓环境管理；配合学校有关部门开展公寓消防安全及学生行为管理；开展员工招聘和使用，组织基本的业务技能培训；开展公寓文化和公寓精神文明建设，创建标准化公寓；履行公寓管理委员会的有关职能，指导学生自律委员会开展活动。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		运行管理科科长（或副科长）负责后勤运行制度设计及调整，开展标准化建设，制定和完善促进后勤科学运行的各项规章制度和管理办法；后勤运行计划制定、监督及运行状况评价，后勤经费使用计划编制、预决算工作；后勤重大项目立项审批、招标、验收、结算，国家财政项目申报、执行，管理、审查各类项目合同；后勤服务质量监督管理，落实各级各类岗位规范；后勤各单位安全生产监督管理等。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		三、任职条件与资格<span> </span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		1.学校在岗事业编制教职工。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		2.具有履行职责所需的政治理论水平，认真学习马列主义、毛泽东思想和中国特色社会主义理论，政治坚定，作风正派，秉公办事，遵纪守法。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		3.有胜任管理工作的组织能力、文化水平和专业知识；工作认真负责，有奉献和创新精神；能团结同志一起工作。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		4.应具有大学本科以上文化程度或中级以上技术职称，一般应具有<span>3</span>年以上工龄。应聘正科级职务的，一般应在副科级岗位上工作<span>2</span>年以上，七级职员及具有硕士以上学位或中级以上职称且具有<span>5</span>年以上工龄、工作业绩突出者，可不受此条件限制。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		5.应聘办公室主任（或副主任）者，应为中共正式党员；应聘运行管理科科长（或副科长）者，要求工学或管理类专业。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		6.身体健康，精力充沛。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		四、聘任程序<span> </span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>1.</b><b>学校成立公开选聘工作小组。</b>由有关校领导、职能部门负责人组成，负责干部人选的选聘工作。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>2.</b><b>发布信息。</b>学校下发通知并在校园网发布公告，公布选聘职位、资格条件、工作程序等内容。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>3.</b><b>报名与资格审查。</b>自下发通知之日起开始受理个人报名，报名人员须填写《中国矿业大学（北京）公开选聘后勤处科级干部报名表》（见附件），于<b><span>10</span>月<span>9</span>日<span>16:00</span>前</b>将《报名表》交一号办公楼<span>302</span>室。党委组织部会同纪委、人事处等有关部门进行资格审查。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>4.</b><b>面试答辩。</b>面试答辩主要测试应聘者政策理论水平、专业知识、应变能力以及对公开选聘职位的适应程度。进行面试答辩的具体时间、地点另行通知。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>5.</b><b>组织考察。</b>公开选聘工作小组根据面试答辩和日常考核情况，研究确定考察人选，并在一定人员范围内进行考察。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>6.</b><b>讨论决定。</b>公开选聘工作小组根据面试答辩、日常考核和考察结果，讨论确定干部建议人选，党委常委会根据任职条件与资格及建议人选的基本情况，研究决定拟聘人选的具体岗位和职级。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32.15pt;\" class=\"MsoNormal\">\r\n		<b>7.</b><b>公示与任职。</b>对拟任人选在全校范围进行公示，公示结果不影响任职的，行文聘任。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		五、工作要求<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		1.选聘工作小组成员、考察组成员及相关工作人员要严格遵守保密纪律，要坚持标准，客观公正，公道正派。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		2.报名参与人员要正确对待竞争，不准弄虚作假以及搞拉票等非组织活动。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		联系电话：<span>62331206</span>。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		监督电话：<span>62331431</span>。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		特此通知。<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		附件：中国矿业大学（北京）公开选聘后勤处科级干部报名表<span></span>\r\n	</p>\r\n	<p style=\"text-indent:64pt;\" class=\"MsoNormal\">\r\n		（请登录校党委组织部网页“下载专区<span>/</span>干部工作”<span></span>\r\n	</p>\r\n	<p style=\"text-indent:88pt;\" class=\"MsoNormal\">\r\n		下载，或到组织部领取）<span></span>\r\n	</p>\r\n	<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-align:center;margin-left:174.3pt;\" class=\"MsoNormal\" align=\"center\">\r\n		&nbsp;中共中国矿业大学（北京）委员会<span></span>\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014年<span>9</span>月<span>24</span>日<span></span>\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p style=\"text-indent:176pt;\" class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		&nbsp;\r\n	</p>\r\n	<p class=\"MsoNormal\">\r\n		<span>&nbsp;</span>\r\n	</p>\r\n	<div>\r\n		<p class=\"MsoNormal\">\r\n			<span>&nbsp;</span>中国矿业大学（北京）党政办公室<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014</span>年<span>9</span>月<span>24</span>日印发<span>&nbsp; &nbsp;</span><span></span>\r\n		</p>\r\n	</div>\r\n</div>', '', '', '', '', '1'), ('65', '61', '0', '272', '0', '0', '1414569949', '1414569949', '0', '', '', '后勤处关于招聘研究生主任助理及本科见习生的公告 ', '<div align=\"left\">\r\n	<span>为提升学校后勤服务水平，促进后勤工作的有序接替，现面向我校公开招聘研究生主任助理及本科见习生从事学校后勤工作。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 一、研究生主任助理&nbsp;&nbsp;</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 1、招聘条件</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; \r\n（1）全日制统招统分的二年级或三年级硕士研究生，原则上本科毕业院校应为“211工程”学校，品学兼优；</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; （2）有志于从事后勤工作，能胜任相关专业领域的工作；</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; \r\n（3）每周至少保证4个工作日到岗，能够持续工作一学期以上；</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; （4）三年级研究生需通过CET-6考试。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 2、招聘专业：</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; \r\n电力系统及其自动化、建筑与土木工程、供热供燃通风及空调工程等工科类专业、管理类专业。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 二、本科见习生&nbsp;&nbsp;</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 1、招聘条件</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; （1）&nbsp; 大学四年级本科生，北京生源，品学兼优。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; （2）&nbsp; \r\n每个工作日保证至少1小时工作时间，每周不少于8小时。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 2.招聘专业</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 土木工程、电气工程及其自动化等工科类专业。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 三、待遇</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; \r\n研究生主任助理每月给予工作补贴2000元、本科见习生每月给予工作补贴500元。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 四、报名</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 应聘者于2014年10月16日—10月24日期间, \r\n将简历及有关证书送到3号行政办公楼322室，</span><a href=\"mailto:%E6%88%96%E5%B0%86%E4%B8%AA%E4%BA%BA%E7%AE%80%E5%8E%86%E5%8F%91%E9%80%81%E8%87%B3cumtbhq@126.com%E9%82%AE%E7%AE%B1%EF%BC%8C%E5%92%A8%E8%AF%A2%E7%94%B5%E8%AF%9D%EF%BC%9A62339068\"><span>或将个人简历发送至邮箱cumtbhq@126.com，咨询电话：62339068</span></a><span>。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; 五、考核录用</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp; \r\n10月下旬通知符合条件的人员进行综合考察，确定人选并于11月正式上岗。</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"left\">\r\n	<span></span>&nbsp;\r\n</div>\r\n<div align=\"right\">\r\n	<span>中国矿业大学（北京） 后勤处</span>\r\n</div>\r\n<div align=\"right\">\r\n	<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n二〇一四年十月十五日</span>\r\n</div>', '', '', '', '', '1'), ('66', '61', '1', '272', '0', '0', '1414570047', '1432639665', '0', '', '', '中国矿业大学（北京）  关于开展五级、六级职员岗位聘任工作的通知', '<p style=\"text-indent:2em;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\" class=\"MsoNormal\" align=\"center\">\r\n	<span style=\"line-height:1.5;\"></span> \r\n</p>\r\n<div class=\"Section1\">\r\n	<p class=\"MsoNormal\" align=\"center\" style=\"text-align:left;\">\r\n		<br />\r\n	</p>\r\n	<div class=\"Section1\">\r\n		<p style=\"text-align:center;\" class=\"MsoNormal\" align=\"center\">\r\n			<b>&nbsp;</b> \r\n		</p>\r\n		<p style=\"text-align:center;\" class=\"MsoNormal\" align=\"center\">\r\n			&nbsp;\r\n		</p>\r\n		<p style=\"text-align:center;\" class=\"MsoNormal\" align=\"center\">\r\n			中矿京党字〔<span>2014</span>〕<span>20</span>号<span></span> \r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			纪委，各分党委（党总支）、党委各部门，工会，团委，各有关单位：<span> </span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			根据《中国矿业大学（北京）高级职员岗位设置与聘任办法（试行）》（中矿京党字〔<span>2014</span>〕11号）精神，经<span>2014</span>年<span>10</span>月<span>22</span>日校党委常委会议研究，决定开展学校首轮五级、六级职员岗位聘任工作。现将有关事项通知如下：<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			一、聘任范围<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			专职从事党政管理工作的副处级和正科级干部及辅导员。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			二、岗位职数<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			按照《中国矿业大学（北京）高级职员岗位设置与聘任办法（试行）》规定，结合学校现有干部队伍情况，本次可晋升五、六级职员共<span>11</span>个，其中可晋升五级岗位<span>3</span>个，六级岗位8个。\r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			三、申报条件<span></span> \r\n		</p>\r\n		<p style=\"text-indent:31.35pt;\" class=\"MsoNormal\">\r\n			（一）基本条件<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			1.拥护党的领导，遵守宪法和法律，具有良好的思想政治素质、职业道德和服务意识。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			2.长期从事学校管理工作，系统掌握履行岗位职责所需的理论知识和技能，有较强的组织管理能力及解决本职工作中实际问题的能力。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			3.有强烈的事业心与责任感，爱岗敬业，求真务实，工作业绩突出，群众认可度高；年度和聘期考核均为称职（合格）以上等次。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:31.35pt;\" class=\"MsoNormal\">\r\n			4.一般应具有大学本科以上文化程度。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:31.35pt;\" class=\"MsoNormal\">\r\n			5.身心健康，能胜任本职工作。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:31.35pt;\" class=\"MsoNormal\">\r\n			（二）具体条件<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			申报五级职员者须担任副处级领导职务满<span>10</span>年；申报六级职员者须担任正科级职务满<span>10</span>年，或具有研究生学历，且连续担任辅导员满<span>7</span>年的<span>35</span>岁以上的现职辅导员。\r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			四、工作机构<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			学校成立高级职员聘任工作委员会，负责组织本次职员岗位聘任工作，委员会办公室设在组织部。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			主<span>&nbsp; </span>任：徐孝民<span>&nbsp; </span>杨仁树<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			副主任：范<span>&nbsp; </span>迅<span>&nbsp; </span>朱书全<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			成<span>&nbsp; </span>员：孙继平<span>&nbsp; </span>姜耀东<span>&nbsp; </span>王忠强<span>&nbsp; </span>邹得志<span>&nbsp; </span>胡喜宽<span></span> \r\n		</p>\r\n		<p style=\"text-indent:96pt;\" class=\"MsoNormal\">\r\n			高全臣<span>&nbsp; </span>常维亚<span>&nbsp; </span>刘宗光<span>&nbsp; </span>钱晓红<span>&nbsp; </span>冀帅领<span></span> \r\n		</p>\r\n		<p style=\"text-indent:96pt;\" class=\"MsoNormal\">\r\n			王家臣<span>&nbsp; </span>刘<span>&nbsp; </span>波<span>&nbsp; </span>李&nbsp;妍<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			办公室主任：邹得志\r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			五、聘任程序<span></span> \r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			1.学校发布聘任工作通知。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			2.申报人填写《中国矿业大学（北京）五级、六级职员岗位聘任申报表》（见附件），与有关证明材料（本人最高学历、专业技术职务、公开发表与本职工作有关论文成果、获得校级及以上有关奖励等材料复印件）一起于<span>10</span>月<span>31</span>日<span>16:00</span>前报党委组织部。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			3.对申报人进行资格审查。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			4.对符合条件的申报人在一定人员范围内进行民主测评。\r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			5.聘任工作委员会根据确定的职员岗位数和申报人条件、民主测评等情况，经充分讨论，以无记名投票方式确定聘任建议人选。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			6.校党委常委会对建议人选进行研究讨论，确定拟聘人选。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			7.对拟聘人选进行公示。公示无异议后，学校发文正式聘任。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:30pt;\" class=\"MsoNormal\">\r\n			六、有关问题说明<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			1.鉴于本次为首轮聘任，且《中国矿业大学（北京）高级职员岗位设置与聘任办法（试行）》（中矿京党字〔<span>2014</span>〕11号）印发时间为<span>2014</span>年<span>6</span>月，所以，凡<span>2014</span>年<span>9</span>月办理退休手续且符合相应任职条件的人员均具有申报资格。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			2.任职年限计算截止日期为<span>2014</span>年<span>9</span>月。\r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			3.晋升为五级、六级职员的人员，享受相应职员职级待遇<span>, </span>干部管理仍按照其实任领导职务进行。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			4.本通知精神由校高级职员聘任工作委员会办公室负责解释。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			特此通知。<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			附件：中国矿业大学（北京）五级、六级职员聘任申报表<span></span> \r\n		</p>\r\n		<p style=\"text-indent:80pt;\" class=\"MsoNormal\">\r\n			（请登录校党委组织部网页“下载专区”栏目下载）<span></span> \r\n		</p>\r\n		<p style=\"text-indent:32pt;\" class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p style=\"text-align:center;margin-left:174.3pt;\" class=\"MsoNormal\" align=\"center\">\r\n			&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;中共中国矿业大学（北京）委员会<span></span> \r\n		</p>\r\n		<p style=\"text-indent:432pt;\" class=\"MsoNormal\">\r\n			2014年<span>10</span>月<span>23</span>日<span></span> \r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			&nbsp;\r\n		</p>\r\n		<p class=\"MsoNormal\">\r\n			<span>&nbsp;</span> \r\n		</p>\r\n		<div>\r\n			<br />\r\n		</div>\r\n	</div>\r\n	<p>\r\n		<br />\r\n	</p>\r\n	<div>\r\n		<p class=\"MsoNormal\" style=\"text-align:left;\">\r\n			<span></span><span></span><span></span><span></span><span></span><span></span> \r\n		</p>\r\n	</div>\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<div>\r\n	<p class=\"MsoNormal\">\r\n		<span></span><span></span><span></span><span></span><span></span><span></span> \r\n	</p>\r\n</div>\r\n<p>\r\n	<br />\r\n</p>', '', '', '', '', '1'), ('67', '61', '0', '272', '0', '0', '1414570638', '1432637256', '0', '', '', '关于申报2015年度外国文教专家聘请计划的通知 ', '<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"98%\" align=\"center\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<br />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"100%\" align=\"middle\">\r\n				<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" align=\"center\" class=\"ke-zeroborder\">\r\n					<tbody>\r\n						<tr>\r\n							<td width=\"100%\" align=\"middle\">\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td id=\"fontzoom\" class=\"newstitle\" valign=\"top\">\r\n								<!-- 文章内容 start -->\r\n								<div>\r\n									<div>\r\n										<div>\r\n											<div class=\"STYLE16\">\r\n												<p>\r\n													根据国家外国专家局和教育部相关文件精神，我校2015年度聘请外国文教专家项目申报工作即将开始。此次我校申报的外国文教专家聘请计划分为五类： <br />\r\n1、聘请对象为某一学科或者专业领域具有国际公认的较高学术造诣的外籍专家或者学者，<strong>每年来华累计时间不少于</strong><strong>60</strong><strong>天</strong>，可以申报<strong>“海外名师项目”</strong>。 <br />\r\n2、通过具有鲜明特征或者独特运作方式实施的聘请<strong>外国文教专家和外籍教师团队（不少于三名知名专家）</strong>从事教学、科研、社会服务和管理等工作的项目，尤其是聚焦某一方面或者某一领域实现不断改进和持续进步的，可以申报<strong>“学校特色项目”</strong>。 <br />\r\n3、根据学科发展和人才培养的实际需要，各单位负责人或者学科带头人可以联合校内（支持跨部门）相关领域教师共同聘请<strong>四人以上的专家团队</strong>申报<strong>“引智平台项目”</strong>，用于促进相关学科的科研发展、人才培养和科研团队建设。 <br />\r\n4、其他涉及国家级、省部级重点项目，高层次人才培养项目，高新技术开发、产学研结合项目，高校重点学科、新兴学科、交叉学科和重点实验室建设等项目，需要聘请外国文教专家的，可以申报<strong>“学校重点外专引智项目”</strong>。 <br />\r\n5、聘请对象为国外院校或科研机构普通学者或研究人员的，可以申报<strong>“聘请外国文教专家普通常规项目”</strong>。 <br />\r\n6、上述五类项目对比情况参见下文所附《各类引智项目对比表》。\r\n												</p>\r\n												<p>\r\n													请有意于2015年度聘请外专的老师于8月30日前联系所在学院主管外事负责人或我处索取相关材料，所有申报材料必须纳入所在学院的《2015年度外专聘请计划汇总表》。 <br />\r\n2015年度外专经费的支出将严格参照申报计划执行。没有申报计划的聘请外专引智任务，我处将不再予以经费支持。\r\n												</p>\r\n												<p>\r\n													联系人：杨英、王红梅 <br />\r\n办公地点：1号办公楼107室、105室<br />\r\n电话：62331301/62339599<br />\r\n电子邮箱：<a href=\"mailto:yangying@cumtb.edu.cn\">yangying@cumtb.edu.cn</a> \r\n												</p>\r\n<a class=\"STYLE15\" href=\"http://international.cumtb.edu.cn/gywm/20140709geleiyinzhixiangmuduibibiao.doc\" target=\"_blank\"><span>附件：各类引智项目对比表</span></a><br />\r\n												<p>\r\n													&nbsp;\r\n												</p>\r\n												<p align=\"right\">\r\n													<span class=\"STYLE15\">中国矿业大学（北京）<br />\r\n国际合作与交流处<br />\r\n二〇一四年七月二日</span> \r\n												</p>\r\n											</div>\r\n										</div>\r\n									</div>\r\n								</div>\r\n<br />\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '', '', '', '', '1'), ('68', '61', '0', '272', '0', '0', '1414570696', '1414570696', '0', '', '', ' 2013、2014年度“长江学者奖励计划”特聘教授招聘启事', '<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n	<span style=\"font-size:14pt;font-family:黑体;\">一、学校简介<span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n	<span style=\"font-size:14pt;font-family:仿宋_GB2312;\">中国矿业大学是一所具有矿业和安全特色，以工为主，理、工、文、管、法、经相结合的全国重点大学，是列入国家“<span>211</span>工程”、“<span>985</span>工程”“优势学科创新平台”建设以及全国首批具有博士和硕士授予权的高校之一，是全国首批产业技术创新战略联盟及北京高科大学联盟成员高校，是教育部与国家安全生产监督管理总局共建高校。学校位于北京市高校云集的海淀区学院路，东眺国家奥林匹克公园，西望颐和园、圆明园与香山。<span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n	<span style=\"font-size:14pt;font-family:仿宋_GB2312;\">学校现设有研究生院和资源与安全工程学院等<span>12</span>个学院，有<span>2</span>个一级学科国家重点学科，<span>8</span>个国家重点学科，<span>1</span>个国家重点培育学科，<span>21</span>个省部级重点学科；有<span>16</span>个一级学科博士点，<span>35</span>个一级学科硕士点，<span>69</span>个二级学科博士点，<span>173</span>个二级学科硕士点，<span>9</span>个硕士专业学位授权点；<span>62</span>个本科专业；<span>8</span>个</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">十五</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">期间</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">211</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">工程</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">重点学科建设项目，<span>14</span>个博士后科研流动站。建有<span>2</span>个国家重点实验室、<span>1</span>个国家工程研究中心、<span>2</span>个教育部工程研究中心，<span>1</span>个北京市重点实验室，<span>20</span>多个基础和专业基础实验室。<span>2007</span>年学校成立了我国首家以能源与安全为特色的科技园<span>---</span></span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">中关村能源与安全科技园</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">和</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">中国矿业大学留学人员创业园</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">。<span>2008</span>年成立了中国矿业大学（北京）首届董事会。目前，共有<span>77</span>家能源企业成为学校董事会董事单位。<span>2010</span>年与北京市共建能源安全产业技术研究院。<span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';text-indent:28pt;\">\r\n	<span style=\"font-size:14pt;font-family:仿宋_GB2312;\">学校现有中国工程院院士<span>6</span>人，中国科学院院士<span>1</span>人。博士生导师<span>127</span>人，硕士生导师<span>197</span>人，专任教师中<span>73%</span>以上的教师具有博士学位，<span>97%</span>的教师具有硕士以上学位。教师中有<span>7</span>人获国家杰出青年科学基金，<span>3</span>人被评为国家级有突出贡献的中青年专家，<span>5</span>人获中国青年科技奖，<span>2</span>人获李四光地质科学奖，<span>9</span>人入选</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">新世纪百千万人才工程</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">国家级人选，<span>2</span>人被评为全国优秀教师，<span>4</span>人被评为北京市优秀教师，<span>11</span>人荣获北京市高等学校教学名师奖，<span>42</span>人被列入教育部跨世纪、新世纪优秀人才支持计划，<span>6</span>人入选北京市科技新星计划。有教育部</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">创新团队发展计划</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">3</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">个，</span><span style=\"font-size:14pt;font-family:宋体;\">“</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">长江学者奖励计划</span><span style=\"font-size:14pt;font-family:宋体;\">”</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">特聘教授<span>6</span>人。<span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"left\" style=\"font-size:10.5pt;font-family:\'Times New Roman\';\">\r\n	<span style=\"font-size:14pt;font-family:黑体;\">二、“长江学者”岗位设置<span></span></span>\r\n</p>\r\n<div align=\"center\" style=\"font-family:宋体;font-siz