\n	<span style=\"font-size:14pt;font-family:仿宋_GB2312;\">二</span><span style=\"font-size:14pt;font-family:宋体;\">〇</span><span style=\"font-size:14pt;font-family:仿宋_GB2312;\">一四年五月三十日</span>\r\n</p>', '', '', '', '', '1');
INSERT INTO `my_articles` VALUES ('69', '61', '1', '272', '0', '0', '1414570759', '1432639810', '0', '', '', '33届国际岩层控制会议（中国）第三轮通知', '<a href=\"http://zyxy.cumtb.edu.cn/news/33rdhuiyitongzhi-3.pdf\">http://zyxy.cumtb.edu.cn/news/33rdhuiyitongzhi-3.pdf</a>', '', '', '', '', '1'), ('70', '61', '0', '62', '0', '0', '1414657048', '1414657048', '0', '', '', '教育部副部长杜玉波见证中国矿业大学（北京）与奥地利雷奥本矿业大学签署合作意向书', '<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" align=\"center\" class=\"ke-zeroborder\">\r\n	<tbody>\r\n		<tr>\r\n			<td valign=\"top\">\r\n				<div style=\"margin:20px;\">\r\n					<div style=\"font-size:14px;\" id=\"content\" class=\"content\">\r\n						<p align=\"center\">\r\n							<img border=\"1\" alt=\"\" src=\"http://news.cumtb.edu.cn/uploadfile/article/uploadfile/201410/wlkx141023-6tp01.jpg\" width=\"600\" height=\"400\" />\r\n						</p>\r\n						<p align=\"center\">\r\n							<img border=\"1\" alt=\"\" src=\"http://news.cumtb.edu.cn/uploadfile/article/uploadfile/201410/wlkx141023-6tp02.jpg\" width=\"600\" height=\"400\" />\r\n						</p>\r\n						<p>\r\n							10月21日下午，中国矿业大学（北京）校长杨仁树应邀参加教育部与奥地利副总理兼科研经济部长莱因霍尔德•米特雷纳代表团的会见，并与奥地利雷奥本矿业大学校长维尔弗里德•爱希尔斯埃德尔签署了两校合作意向书。\r\n						</p>\r\n						<p>\r\n							教育部副部长杜玉波与莱因霍尔德•米特雷纳就中奥两国在教育、科研领域的合作交换了意见。双方希望进一步推动高等教育领域的交流与合作，扩大学生交流规模，在重点领域加强高校间科研合作。\r\n						</p>\r\n						<p>\r\n							<br />\r\n随后，在米特雷纳、杜玉波等见证下，杨仁树与爱希尔斯埃德尔签署了两校合作意向书。\r\n						</p>\r\n						<p>\r\n							奥地利代表团成员还包括外交部长塞巴斯蒂安•库尔茨、驻华大使艾琳娜、科研经济部部长办公室梅莉娜•施耐德、科研经济部科研国际事务司司长芭芭拉•魏特格鲁伯、科研发展理事会主席汉内斯•安德罗斯、驻华使馆科技参赞穆娥、格拉茨大学校长克里丝塔•诺伊佩尔、克莱姆斯IMC专科学校校长卡尔•恩斯费尔讷、对外交流中心主任胡贝特•杜伦施坦、欧亚-太平洋大学联盟沃尔夫-迪特尔•劳施以及维也纳孔子学院外方院长李夏德等。\r\n						</p>\r\n						<p>\r\n							教育部国际合作与交流司司长岑建君、职成司巡视员王继平、国家留学基金委秘书长刘京辉、高教司副巡视员韩筠、科技司副巡视员高润生、国家汉办党委书记、孔子学院总部副总干事、国家汉办副主任马箭飞等出席会谈。\r\n						</p>\r\n					</div>\r\n<br />\r\n<!--本文引用地址：<a href=\"http://news.cumtb.edu.cn/article/show.php?itemid=6134\">http://news.cumtb.edu.cn/article/show.php?itemid=6134</a>-->\r\n				</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p style=\"text-indent:2em;\">\r\n	<br />\r\n</p>', '', '', '', '', '1'), ('71', '61', '1', '272', '0', '0', '1414657125', '1432637202', '0', '', '', '北京市人民政府关于2014年亚太经济合作组织会议期间对本市机动车采取临时交通管理措施的通告', '<p style=\"text-indent:2em;\">\r\n	<span>2014年亚太经济合作组织领导人非正式会议将于11月在北京召开。根据《北京市实施〈中华人民共和国道路交通安全法〉办法》和《北京市大气污染防治条例》，市政府决定，在2014年11月3日至11月12日期间，对本市机动车(含临时号牌车辆)采取临时交通管理措施。现就有关事项通告如下：<br />\r\n一、本市各级党政机关和本市所属的社会团体、事业单位和国有企业的机动车全天停驶70%。<br />\r\n二、运输土方或渣土车辆、危险化学品运输车辆、持有黄色环保标志及悬挂试验车号牌的车辆，全天禁止在本市行政区域内道路行驶。确需进入禁限区域道路行驶的危险化学品运输车辆，办理相关证件后按规定行驶。<br />\r\n三、每天3时至24时，本市核发号牌机动车在本市行政区域内道路按车牌尾号实行单号单日、双号双日行驶(单号为1、3、5、7、9，双号为2、4、6、8、0)，“二〇〇二”式号牌机动车按双号管理。同时，本市暂停实施尾号轮换限行措施。<br />\r\n四、以下机动车遵守下列规定：<br />\r\n(一)货运机动车和专项作业车，每天6时至24时禁止在六环路以内道路(含六环路)行驶；<br />\r\n(二)低速载货汽车、拖拉机和三轮汽车，每天6时至24时禁止在六环路以内道路(含六环路)行驶；0时至6时，禁止在五环路以内道路(含五环路)行驶；<br />\r\n(三)京B号牌摩托车，全天禁止在五环路以内道路(含五环路)行驶；<br />\r\n(四)上述车辆全天禁止在怀柔主城区以内道路行驶。<br />\r\n五、以下机动车不受单双号行驶措施限制，准许在本市行政区域内道路行驶：<br />\r\n(一)公共电汽车、省际长途客运车辆及大型客车、出租汽车(不含租赁车辆)、小公共汽车、持有市运输管理部门核发旅游客车营运证件的车辆，经市公安交通管理部门核定的单位班车和学校校车；<br />\r\n(二)警车、消防车、救护车、工程救险车及执行任务的解放军和武警部队车辆；<br />\r\n(三)持有2014年亚太经济合作组织会议专用车辆证件的车辆；<br />\r\n(四)车身喷涂统一标识并执行公务的城管、工商、交通执法车辆，环保监察车辆及救援、清障等确需通行的专项作业车辆；<br />\r\n(五)环卫、园林、道路养护的专项作业车辆(按市公安交通管理部门批准的时间和路线行驶)；<br />\r\n(六)悬挂“使”字头号牌车辆及经批准临时入境的车辆；<br />\r\n(七)殡仪馆的殡葬车辆。<br />\r\n六、邮政专用车不受单双号行驶措施限制，但邮政专用货车每天6时至24时，禁止在六环路以内道路(不含六环路)行驶。<br />\r\n七、违反本通告规定的，由市公安交通管理部门和市环保部门按照国家和本市有关规定依法处理。<br />\r\n特此通告。<br />\r\n&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n北京市人民政府</span> \r\n</p>', '', '', '', '', '1'), ('79', '61', '0', '272', '0', '0', '1414812170', '1414812170', '0', '', '', '关于开展2014年度优秀人才培养资助工作的通知', '<span> </span><span style=\"font-family:宋体;font-size:12pt;\">各分党委（党总支）、各有关单位：</span><span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp; </span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">《中共北京市委组织部关于开展<span>2014</span>年度优秀人才培养资助工作的通知》已发布，详情见附后的链接。请将文件内容通知到年龄不超过<span>35</span>周岁（计算到<span>2013</span>年<span>12</span>月<span>31</span>日，<span>1979</span>年<span>1</span>月<span>1</span>日以后出生）的青年教师。申报者须于<span>11</span>月<span>3</span>日<span>-11<span><span>月21</span></span><span><span>日</span></span><span>期间，通过网络申报<span>系统按时提交有关材料。</span></span></span> </span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp; </span>\r\n</p>\r\n<span> </span>\r\n<p align=\"center\" style=\"text-align:center;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:宋体;font-size:12pt;\">党委组织部</span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n&nbsp; &nbsp; &nbsp; &nbsp;2014<span><span>年10</span></span><span><span>月30</span></span><span><span>日</span></span></span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">&nbsp; </span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">《通知》的链接为：<span><a href=\"http://www.bjdj.gov.cn/news/20141020/n665710299.html\"><span style=\"color:windowtext;text-decoration:none;\">http://www.bjdj.gov.cn/news/20141020/n665710299.html</span></a> </span></span>\r\n</p>\r\n<span> </span>\r\n<p align=\"left\" style=\"text-align:left;text-indent:24pt;\">\r\n	<span style=\"font-family:宋体;font-size:12pt;\">申报系统的链接为：<span><a href=\"http://bjrcgz.gov.cn/\">http://bjrcgz.gov.cn</a> </span></span>\r\n</p>\r\n<span> </span>\r\n<p>\r\n	<span><span>&nbsp;</span></span>\r\n</p>\r\n<span> </span>', '', '', '', '', '1'), ('73', '1', '1', '11', '0', '0', '1414810742', '1431589184', '0', '', '', '办学规模', '<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp;&nbsp;&nbsp; 中国矿业大学（北京）是教育部直属的全国重点高校、国家“</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">211</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">工程”和“</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">985</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">优势学科创新平台项目”建设高校，是全国首批产业技术创新战略联盟高校，同时也是教育部与国家安全生产监督管理总局共建高校。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1960</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年和</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1978</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，学校先后两次被确定为全国重点高校，为全国首批具有博士和硕士授予权的高校之一，设有研究生院。学校有两个校区：学院路校区坐落于北京市高校云集的海淀区学院路，沙河校区坐落于北京市昌平沙河高教区。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校的前身是由英国福公司创办于</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1909</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年的焦作路矿学堂。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1950</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年学校由焦作迁至天津，更名为中国矿业学院。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1952</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年院系调整期间，天津大学、唐山交大、清华大学的采矿系调整到中国矿业学院，学校因此聚集了全国一流的采矿科学技术人才。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1953</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，为实现更大的发展，学校迁至北京，改称北京矿业学院，成为北京学院路著名的“八大学院”之一。“文革”期间，学校迁至四川省合川县位于华蓥山下的三汇坝镇，更名为四川矿业学院。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 1978年，学校在江苏徐州重建，恢复中国矿业学院校名并在北京学院路原址设立北京研究生部。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1988</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，学校更名为中国矿业大学，邓小平同志亲笔为学校题写校名。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1997</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，经国家教委批准设立中国矿业大学（北京）。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1998</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，恢复本科生教育。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2000</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年，学校整体划转教育部直属管理。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2003</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">月，经中央编制部门批复同意，以“中国矿业大学（北京）”名义办学。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校建设与发展，得到了党和国家领导人亲切关怀。毛泽东同志“开发矿业”的题词曾激励着一代代矿大人为事业不懈奋斗；邓小平同志亲笔批示指引学校在改革开放中走上中兴之路；江泽民同志来校视察学校科研工作并为我校建校</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">90</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">周年题词；胡锦涛同志为我校建校</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">100</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">周年发来贺信。</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">100</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">多年来，学校与中国工业化进程同步发展，与人民共和国一起成长。经过一代又一代矿大人的努力奋斗，学校铸就了中国煤炭高等教育的一流品牌和独特的精神文化品格，形成了“勤奋、求实、进取、奉献”的校风、“好学力行”的学风，积淀形成了艰苦奋斗的创业精神和迎难而上的拼搏精神。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 中国矿业大学（北京）在上级主管部门、煤炭能源行业和社会各界的支持下，通过长期发展和建设，已经形成了以工科为主、以矿业与安全为特色，理工文管法经等多学科协调发展的学科专业体系和多科性大学的基本格局。在煤炭能源的勘探、开发、利用，资源、环境和生产相关的矿建、安全、测绘、机械、信息技术、生态恢复、管理工程等领域形成了优势品牌和鲜明特色。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校现有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">62</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个本科专业，有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">16</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个一级学科博士点，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">35</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个一级学科硕士点，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">69</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个二级学科博士点，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">173</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个二级学科硕士点，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">10</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个硕士专业学位授权点；</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个一级学科国家重点学科，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">8</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个二级学科国家重点学科，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个国家重点培育学科，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">21</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个省部级重点学科；</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">14</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个博士后科研流动站。在教育部</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2012</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年第三轮学科评估中，矿业工程、安全科学与工程、测绘科学与技术、地质资源与地质工程分别排名第一、一、三、四位。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校拥有一支高水平的师资队伍，现有各类教职工</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">911</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人。专任教师中，有教授</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">147</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人，副教授</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">167</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人；博士生导师</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">190</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">名，硕士生导师</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">175</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">名，拥有博士学位的教师比例达</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">74%</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">以上。教师队伍中，有教育部“创新团队发展计划”</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">4</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个，拥有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">名中国科学院院士、</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">6</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">名中国工程院院士，“长江学者奖励计划”特聘教授</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">7</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人；先后有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">7</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人获国家杰出青年科学基金，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">10</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人入选“新世纪百千万人才工程”国家级人选，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">44</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人被列入教育部跨世纪、新世纪优秀人才支持计划，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人获首届中国青年科学家奖，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">4</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人被评为国家有突出贡献的中青年专家，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人被评为“全国优秀教师”，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">4</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人获全国五一劳动奖章，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">4</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人分别获孙越崎能源大奖，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">5</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人获中国青年科技奖，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">3</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人被评为“全国优秀博士后”。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校始终坚持以育人为本，积极构建能源工业精英教育教学体系，致力于培养德智体全面发展、富有社会责任感、创新精神和实践能力的高素质人才。广大毕业生当中许多人已成长为国家现代化建设及行业发展的科技精英、管理骨干和领军人物。学校先后有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">8</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个专业荣获国家“第一类特色专业建设点”项目，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">8</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个专业荣获北京市高等学校特色专业项目，“安全工程”专业在全国第一个通过教育部工程教育专业认证。拥有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个国家级实验教学示范中心，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个国家级工程实践教育中心；</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1998</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年以来，我校学生参加省级以上国内外科技竞赛千余人次获奖；先后有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">9</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">篇博士论文入选全国百篇优秀博士论文。目前全校有全日制普通本科生</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">5900</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">余人，各类硕士、博士研究生</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">6100</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">余人，成人教育本专科生3100余人，留学生</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">34</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">人。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 围绕人才培养的核心任务和国家及行业的战略需求，学校致力于科学研究，提升学校的创新能力，取得了一大批高水平科技成果。“十五”以来，先后获得国家级科技奖励</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">22</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">项，省部级科技奖励</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">232</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">项。在研科研项目</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">770</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">余项，研究与发展经费快速增长。学校建设了完备的高水平科技创新平台，拥有</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个国家重点实验室，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个国家工程研究中心，</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个教育部工程研究中心、</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">个北京市重点实验室。学校图书馆拥有藏书</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">79</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">万余册，电子图书</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">55</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">万册。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校积极发挥自身优势，服务行业人才培养、科技进步及地方经济社会发展，推进产学研协同创新。以校理事会为平台大力推进社会服务，校理事会成员单位发展到</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">77</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">家；建成了我国首家以能源与安全为特色的科技园</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">---</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">“中关村能源与安全科技园”和“中国矿业大学留学人员创业园”，并与北京市共建能源安全产业技术研究院。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 学校积极开展国内外学术交流与合作，不断推进国际化办学。目前，与国内</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">10</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">所高水平行业特色型大学联合发起成立“北京高科大学联盟”，与</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">21</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">所世界著名高校和科研院所签订了校际合作协议，与</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">80</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">余所国外知名大学和科研院所的相关学科开展了学术交流；多次举办了国际煤岩学委员会年会、国际有机岩石学年会（</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">ICCP-TSOP</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">）联合会议、第一届行为安全与安全管理国际会议、国际有机岩石学会（</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">TSOP</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">）年会、国际采矿科学与技术大会等国际性学术会议，学术交流日益活跃。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">&nbsp; &nbsp; 中国矿业大学（北京）坚持“面向现代化、面向世界、面向未来”的指导方针，按照“强化特色、提高质量、充实内涵、外向发展”的总体发展思路，抓住“统筹规划、队伍建设、科学管理”三个关键，使学校整体办学水平实现新的跨越发展，努力把学校建成特色鲜明、国际知名的高水平矿业大学。（</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">2014</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">年</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">7</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">月</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">12</span><span style=\"font-family:FangSong_GB2312;font-size:18px;font-style:inherit;font-weight:inherit;\">日更新）</span> \r\n</p>', '', '', '', '', '1'), ('83', '5', '0', '38', '86', '0', '1414852895', '1414852895', '0', '', '', '数据测试', '数据测试！！！<br />', '', '', '', '', '5'), ('75', '1', '0', '16', '0', '0', '1414810920', '1414810920', '0', '', '', '中国矿业大学（北京）2013-2014学年信息公开年度报告', '<p align=\"left\" class=\"MsoNormal\" style=\"color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">中国矿业大学（北京）按照《高等学校信息公开办法》（教育部令第29号）和《教育部关于公布&lt;高等学校信息公开事项清单&gt;的通知》（教办函[2014]23号）的有关要求，牢固树立“以公开为原则，不公开为例外”的理念，为更好地服务师生和社会公众，积极推进并扎实做好信息公开工作。2013-2014学年信息公开年度报告，由信息公开概述、信息公开情况、主要问题和改进措施三部分组成。本报告中所列数据的统计期限自2013年9月1日起至2014年8月31日止。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32.15pt;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">一、信息公开概述</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span></b>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（一）完善信息公开制度</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2013-2014学年，中国矿业大学（北京）积极贯彻落实《办法》，构建了学校党政主要负责人领导、党政办公室牵头负责协调、各单位具体实施、纪委监察部门监督检查、师生员工积极参与的信息公开工作机制；学校专门成立了信息公开领导小组、信息公开办公室，明确了各组织机构的工作职责；学校出台了《中国矿业大学（北京）信息公开实施办法（试行）》（中矿大京字</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">[2011]11</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">号）、《中国矿业大学（北京）信息公开保密审查暂行规定》（中矿大京字</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">[2011]13</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">号）、《中国矿业大学（北京）&lt;高等学校信息公开事项清单&gt;落实细化方案》（中矿大京字</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">[2014]30</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">号），进一步修订和完善了《信息公开指南》、《信息公开目录》。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（二）改版升级信息公开网站</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">按照教育部有关要求，规范学校信息公开工作，便于师生及社会公众对学校属于应当公开的信息进行查询，推进信息公开网上专栏的规范化、标准化建设，2014年，学校对信息公开网进行了改版升级，将原先信息公开栏目增加到10个一级类目50个二级目录，增加了公开信息内容检索，实现了与学校现有网站资源的关联和共享，保证了信息的唯一性、及时性、准确性。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">&nbsp;</span><b><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">二、信息公开情况</span></b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（一）主动公开信息情况</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">1．主动公开信息数量</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2013-2014学年，全校新增的主动公开信息共</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2165</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">条，其中通过校园网公开的信息达到</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">1200</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">余条。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2．主动公开信息内容</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">1</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学校名称、办学地点、办学性质、办学宗旨、办学层次、办学规模、机构设置等基本信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学校教育教学、科学研究、服务社会和文化传承创新等方面的规划，总结等信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">3</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）校园文化、理论宣贯、政策督查，反腐倡廉等党务信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">4</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学校各学历层次和各类学生招生录取、学生学籍管理、教学成果申报及评审结果、课程设置、实习答辩、学位授予、推免研究生、本科生转专业等教学管理信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">5</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学科与专业设置，重点学科建设等学科建设信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">6</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学校科研项目申报、科研奖励制度和科研项目结果等科研管理信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">7</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）干部培训与考核、人事任免信息、招考录用、职称评审办法和结果等有关人事工作信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">8</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）学校财务、资产相关规章制度，年度预决算方案，</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">学校经费来源构成、资产、图书馆藏书，教育收费管理项目、依据、标准与投诉方式等财务资产信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">&nbsp;&nbsp; （</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">9</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）饮食服务、校园安保、校园规划与建设等后勤保卫基建信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:23.95pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">10</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">）帮困助学、学生奖励、就业指导等学生管理信息。</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:8pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">3．主动公开信息形式</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">通过校园网、会议、校发文件、校报、宣传栏、橱窗、海报、广播、电视台等形式及时公开学校信息。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（二）依申请公开情况</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">中国矿业大学（北京）已在《信息公开实施办法（试行）》和《信息公开指南》中明确了依申请公开有关要求。在</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2013-2014</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">学年中没有收到相关依申请公开信息。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（三）对信息公开的评议情况</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">学校不定期组织师生代表以座谈会等形式对全校信息公开工作情况进行评议，评议内容包括信息公开工作的制度建设、公开形式、公开效率、服务质量等方面。学校师生对学校信息公开工作给予了普遍认可和高度评价。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（四）信息公开工作举报情况</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2013-2014学年度，学校没有收到信息公开工作的任何举报。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:32.15pt;background-color:#FFFFFF;\">\r\n	<b><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">三、主要问题和改进措施</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span></b>\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"color:#000000;text-indent:30pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">学校信息公开工作自开展以来取得了一定的成效，但在工作开展中仍存在一些问题。如信息公开意识需进一步加强，信息公开培训和业务指导力度仍需加强；一些基层单位部门的信息公开工作实施情况还不够平衡、不够规范；在主动公开、依申请公开等深化信息公开的长效机制建设方面还有待进一步探索和完善。下一阶段拟重点做好以下工作：</span>\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"color:#000000;text-indent:30pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（一）进一步完善信息公开工作机制。不断强化校院两级领导工作机构，建立起科学高效的信息公开工作机制。进一步明确信息公开的基本原则，切实规范信息公开的范围、方式和程序，加强信息公开的监督考核和保障措施，确保信息公开工作制度化、规范化、专业化和常态化。</span>\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"color:#000000;text-indent:30pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（二）进一步加强对学校信息公开工作的宣传和培训。学校从事信息公开工作的专职人员较少，工作任务较为繁重，又加之信息公开工作的复杂性，需要进一步加强全校各部门对信息公开有关法律法规和规章制度等方面知识的培训力度，进一步增强各部门对信息公开工作的重要性认识，促进学校信息公开工作的规范和完善，不断提升学校信息公开整体工作水平。</span>\r\n</p>\r\n<p align=\"left\" class=\"MsoNormal\" style=\"color:#000000;text-indent:30pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">（三）进一步畅通办事公开的意见反馈渠道，积极探索学校与公众的双向交流。在加强网络技术的运用，逐步实现公众网上评议、网上咨询和网上征求意见的同时，进一步开设申请信息公开受理专线，统一公布各相关部门的监督电话，方便群众监督和咨询。</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">&nbsp;</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">&nbsp;</span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:left;color:#000000;text-indent:24pt;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">&nbsp;</span>\r\n</p>\r\n<p align=\"right\" class=\"MsoNormal\" style=\"text-align:right;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">中国矿业大学（北京）</span><span style=\"font-family:&quot;Helvetica Neue&quot;, &quot;Microsoft YaHei&quot;, Helvetica, Arial, sans-serif;font-size:12px;font-style:inherit;font-weight:inherit;\"></span>\r\n</p>\r\n<p align=\"right\" class=\"MsoNormal\" style=\"text-align:right;color:#000000;text-indent:0px;background-color:#FFFFFF;\">\r\n	<span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">2014年</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">10</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">月</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">25</span><span style=\"font-family:SimSun;font-size:16px;font-style:inherit;font-weight:inherit;\">日</span>\r\n</p>', '', '', '', '', '2'), ('82', '3', '0', '25', '72', '0', '1414820835', '1414820835', '0', '', '', '财务管理', '财务管理', '', '', '', '', '9'), ('84', '61', '1', '65', '0', '0', '1432639845', '1432639845', '0', '', '', 'sssssssss大学', '阿萨德法师到付阿士大夫阿士大夫阿士大夫士大夫', '', '', '', '', '1'), ('85', '61', '1', '65', '0', '0', '1432639867', '1432639867', '0', '', '', '啊阿萨德撒的', '阿士大夫阿士大夫撒的f', '', '', '', '', '1'), ('86', '61', '0', '64', '0', '0', '1432641418', '1432641418', '0', '', '', 'adsfsaf', 'asdfasdfsdf', '', '', '', '', '1');
COMMIT;

-- ----------------------------
--  Table structure for `my_battery_info`
-- ----------------------------
DROP TABLE IF EXISTS `my_battery_info`;
CREATE TABLE `my_battery_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `sid` bigint(18) NOT NULL COMMENT '站id',
  `battery_factory` varchar(100) NOT NULL COMMENT '电池生产厂家',
  `battery_num` varchar(50) NOT NULL COMMENT '电池编号',
  `battery_date` datetime NOT NULL COMMENT '电池生产日期',
  `battery_voltage` double(12,2) NOT NULL COMMENT '电池标称电压',
  `battery_oum` double(10,2) NOT NULL COMMENT '电池标称内阻 毫欧',
  `battery_max_current` double(10,2) NOT NULL COMMENT '电池最大充电电流',
  `battery_float_up` double(10,2) NOT NULL COMMENT '电池浮充电压上限',
  `battery_float_dow` double(10,2) NOT NULL COMMENT '电池浮充电压下限',
  `battery_discharge_down` double(10,2) NOT NULL COMMENT '电池放电电压下限',
  `battery_scrap_date` date NOT NULL COMMENT '电池强制报废日期',
  `battery_life` double(10,2) NOT NULL COMMENT '电池设计寿命 年',
  `battery_column_type` varchar(20) NOT NULL COMMENT '电池级柱类型',
  `battery_humidity` double(10,2) NOT NULL COMMENT '电池湿度要求 %',
  `battery_temperature` double(10,2) NOT NULL,
  `battery_type` varchar(50) NOT NULL COMMENT '电池类型',
  `battery_factory_phone` varchar(20) NOT NULL COMMENT '电池厂家联系电话',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=103 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Records of `my_battery_info`
